location_text: """Распространение и места обитания

Ареал камышового кота довольно большой: от Передней и Малой Азии, Закавказья, Средней Азии до Индостана и Индокитая. Есть он в Африке, в долине Нила. В России камышовый кот встречается в равнинной части Дагестана и по побережью Каспийского моря до устья Волги, по рекам Терек и Кума до Ставрополья и Северной Осетии.

