description_continuation: """Внешний вид и особенности морфологии

Камышовый кот крупнее любой домашней кошки: длина туловища - от 60 до 90 см, хвоста - 30-35 см. Вес может быть до 12 кг, высота в холке достигает 50 см. Более мелкие коты водятся в Таиланде и на Шри-Ланка, а самые крупные - на Кавказе и в Палестине.

Камышового кота не зря ещё называют болотной рысью - у него схожая с евразийской рысью окраска и чёрные кисточки на ушах. Общий тон окраски в разных частях ареала немного варьирует, но в целом напоминает цвет сухого камыша (серовато-песочный). У котят и молодых животных на лапах и хвосте есть темные полоски, с возрастом они исчезают или становятся нечеткими. Также слабо заметный рисунок из пятен и полосок есть на спине и боках. Около носа и на подбородке шерсть светлая, почти белая.

Питание и кормовое поведение

Коты - хищники, питающиеся практически только животной пищей. Они с успехом охотятся не небольших птичек, иногда ловя их прямо в полёте, едят яйца и птенцов в гнёздах. Большую часть их рациона составляют разнообразные грызуны, но могут ловить и есть лягушек, змей, ящериц, а также насекомых. Самой крупной добычей являются зайцы и даже детёныши кабана. Камышовые коты прекрасно плавают и даже ныряют, поэтому для них доступны и водоплавающая птица, и рыба. Есть наблюдения за котом на рыбалке: «Хищник потихоньку хлопал лапой по воде, а рыба привлечённая движением воды, сходным с тем, какое производит попавшее в воду насекомое, подплывала и сама оказывалась добычей».

Во время зимних холодов коты могут пробираться к человеческому жилью и охотиться за домашней птицей.

Охотятся эти хищники преимущественно в сумерках и ночью. Способы охоты типичны для кошачьих - выслеживание, подкрадывание к добыче, молниеносный бросок и схватывание её когтями с одновременным укусом.

Образ жизни и социальное поведение

Подобно подавляющему большинству видов кошек, хаус ведёт одиночный образ жизни. Самцы и самки встречаются лишь для размножения. Семьями живут только самки с котятами.

Вокализация

Звуки, издаваемые котами, достаточно разнообразны: это и мяуканье, и шипение, и громкие протяжные крики. Особенно часто и самцы, и самки звучат в брачный период.

Размножение и родительское поведение

Брачный период обычно наступает в феврале-марте. Самки издают призывное мяуканье, и самцы со всей округи спешат на зов. Если около самки оказывается два или несколько котов, между ними могут возникать ожесточённые бои, сопровождающиеся громкими криками.

Беременность продолжается немногим более двух месяцев, и перед родами самка начинает обустраивать логово, где родятся котята. Обычно оно находится в труднодоступном месте – где-нибудь у корней в непролазной чаще колючего кустарника. Котят в помёте бывает обычно от 3 до 6, вес новорождённого 60-100 г. Глаза у детёнышей начинают открываться  на 10-й день, слышать котята начинают раньше.

Продолжительность жизни

Живут камышовые коты, в среднем, 15 лет. В зоопарках при хорошем и правильном уходе дольше.

Жизнь в зоопарке

Камышовый кот прибыл в наш зоопарк в октябре 2016 года из зоопарка Франции полугодовалым котёнком. После необходимого карантина его поселили на экспозиции «Фауна России» на Старой территории. Его вольер очень хорошо оборудован: здесь есть и где полазить, и где спокойно посидеть, наблюдая за птицами на ближайших деревьях. Также в вольере несколько убежищ, чтобы зверь мог отдохнуть от постоянного внимания и спокойно выспаться. Поэтому, придя в зоопарк, всмотритесь внимательно – возможно, кот наблюдает за окружающим из укромного уголка. Если всё-таки не увидели животное, значит, оно спит в домике.

Подобно другим кошачьим, камышовый кот активен в основном в  утренние и вечерние часы. Для того, чтобы посетители чаще видели животное, в течение дня устраиваются показательные кормления. Кроме них с котом проводят ежедневные тренинги – приучают без страха заходить в переносную клетку, не бояться осмотра и ветеринарных процедур. А для того, чтобы животное больше двигалось и могло проявлять свои естественные формы поведения, киперы еду дают не «на тарелочке», а прячут в самых разных местах.

Основной корм камышового кота – мыши, крысы, перепёлки, кусочки куриного мяса и говядины."""
