location_text: """Вид и человек
Одомашнивание гуанако произошло около 5000 лет назад, и лама является одним из самых первых домашних животных в истории человечества. В суровом климате гор лама стала незаменимым помощником, прежде всего, как вьючное животное. Из шерсти и шкур делали замечательную теплую одежду, мясо самцов инки ели, но только по особым случаям, а самок никогда не забивали. У инков даже было некое божество «Urcuchillay» (хранитель пастухов), которого изображали в виде разноцветной ламы. Также изображение ламы встречается на керамике культуры моче (существовала в северной части Перу примерно от сотого года до нашей эры). Во время религиозных праздников самцов-детенышей приносили богам в жертву. Верховному богу Виракоче полагался бурый, богу молнии Ильяпе — пегий (под цвет грозового неба), а богу солнца Инти — белый.

