Навьючивают только самцов, которые крупнее и сильнее самок. Однако и они могут нести не очень большой груз — около 50 кг. Если же вес поклажи превышает возможности животного, оно начинает сердиться — прижимает уши, лягается, плюется слюной, перемешанной с содержимым желудка. Но самое действенное в таких случаях — это лежачая забастовка. Раздраженная лама ложится, и никакими силами ее невозможно сдвинуть с места — она встанет только тогда, когда уменьшат поклажу. Шутят даже, что в каждую ламу встроены весы. За день груженая лама способна пройти до 30 км, однако в повозки их не впрягают, это участь лошадей, ослов и мулов. В древности лишь изредка на ламах пахали землю.

Самки находятся в привилегированном положении — их не заставляют носить тяжести, их не доят, они не участвуют в других хозяйственных работах. Даже во времена, когда боги инков требовали жертвоприношений, самки оставались в безопасности, а их главной задачей было продолжение рода. Первого детеныша лама способна произвести на свет, едва достигнув двух лет, и дальше может рожать ежегодно. Содержание лам практически ничего не стоит: животные круглый год живут на высокогорных пастбищах, и раз в два года их стригут. Стрижка производится в период с ноября по апрель, так что к сезону низких температур, приходящегося на июнь—август, шерстный покров успевает восстановиться. Из шерсти лам делают в основном валяные изделия, а благодаря множеству цветовых вариаций шерсти, изделия даже не приходится красить.

В 19 веке лам завезли в Европу, и в Альпах они с успехом выполняют те же функции, что и в родных Андах.

В настоящее время потребность в ламах, как во вьючных животных значительно уменьшилась, прежде всего, из-за развития авто и авиатранспорта. Потребность в шерсти, которая значительно уступает по качеству шерсти альпаки, также снизилась. Все это привело к тому, что численность лам заметно сократилась, основное их поголовье сосредоточено вокруг озера Титикака, где они, в основном, обслуживают туристов.

