Образ жизни и социальное поведение
Жизнь капибары тесно связана с водой, поэтому ее распространение зависит от сезона: в дождливый сезон капибары вслед за водой рассеиваются по большому пространству, а в сухой сезон скапливаются около водоемов. Обычно они активны днем, только в местах, где их сильно беспокоят, капибары переходят на ночной образ жизни. При возникновении опасности скрываются в воде. Могут оставаться под водой довольно долго, а для того, чтобы дышать выставляют из воды кончик морды с ноздрями.

Капибары общественные животные. Обычно они держатся группами по 10–20 особей. Группа состоит из доминантного самца, нескольких самок с детенышами и подчиненных самцов, которые держатся на периферии группы. Во время сухого сезона, когда животные собираются около оставшихся водоемов, размер групп может увеличиться до нескольких сотен особей. Небольшой процент животных, обычно это взрослые самцы, живут поодиночке.

Группа капибар может занимать площадь до 10 гектар, однако большую часть времени они проводят на площади менее 1 га. Границы своего участка животные обозначают запаховыми метками. Самцы оставляют запаховые метки на растительности для привлечения самок.
Иногда возникают конфликты между хозяевами участка и пришельцами.

Питание и кормовое поведение
Капибары прекрасно плавают и ныряют. Питаются они клубнями и зелеными частями водных и околоводных растений. В некоторых районах капибары считаются вредителями, так как могут посещать поля с зерновыми культурами и сахарные плантации, где конечно не упустят случая полакомиться. Лакомятся они и бахчевыми культурами — дынями и кабачками, но основной корм для капибар — водные растения.

Вокализация
Могут издавать щелкающие и лающие звуки.

Размножение и выращивание потомства
Размножаются капибары круглый год. Спаривание происходит в воде. Для рождения детенышей самка не сооружает никакого укрытия. Обычно в помете от 2-х до 8 детенышей, чаще 4 — 6. Малыши появляются на свет хорошо сформированными, покрытыми шерстью, с открытыми глазками и прорезавшимися зубками. Весят новорожденные до 1,5 кг. Очень скоро они начинают следовать за матерью и есть траву, но до 4-х месяцев самка продолжает кормить их молоком. Все самки в группе ухаживают за малышами. Молодые достигают половой зрелости к 18 месяцам, при весе 30–40 кг.

Продолжительность жизни
В неволе капибары могут жить до 12 лет, в дикой природе продолжительность жизни меньше.

Животное в Московском зоопарке
У нас живет пара водосвинок.
Самец родился в Московском зоопарке в 2012 году. Самка приехала из Риги, в 2013-м. Сначала животных держали отдельно друг от друга, но теперь они живут вместе. В 2017 году у них родился детеныш. Летом их можно увидеть гуляющими в вольере «Южная Америка» вместе с ламой, викуньей и гуанако. Звери хорошо уживаются друг с другом, не ссорятся и даже иногда едят вместе из одной кормушки.

В этом вольере есть большой ров, наполненный водой, такое сооружение заменяет решетки в современных зоопарках. А заодно — это просторный бассейн, где животные могут купаться. Капибары проделывают это с удовольствием. Они и плавают, и плавно бегают по дну бассейна, как бегемотики, доставляя этим удовольствие не только себе, но и посетителям.
Зимой капибары переселяются в теплый домик, с левой стороны вольера.

Капибары — тропические животные, наша длинная и суровая зима не для них. В теплом помещении для водосвинок соорудили бассейн, где они могут купаться в теплой воде. Вместе с капибарами в теплом зимнем домике живут игуаны — Южноамериканские крупные ящерицы. Для них и для капибар в вольере установлена специальная греющая лампа. Она заменяет этим животным солнечное тепло.

