Вид и человек
Рыжая лисица распространена очень широко, встречается во множестве стран, имеет яркую внешность и, конечно, не обделена вниманием со стороны человека. Лисица — постоянный персонаж сказок, легенд, мифов. Она воплощает собой хитрость и коварство, выступая в довольно разнообразных ролях: от вероломных негодяев (в большинстве русских сказок) до умных советчиков (как в сказке Бориса Шергина «Пойга и лиса»). И на востоке, и на западе распространены легенды об оборотнях-лисах, способных превращаться в обольстительных женщин, дарить волшебные подарки, а зачастую — и губить доверившихся им людей. В японской мифологии лисы-оборотни (кицунэ) обладают огромными знаниями и владеют магией. Позже кицунэ стали популярны в литературе, кино и видео играх. Похожие духи фигурируют также в китайских и корейских мифах. В месопотамской мифологии лиса — священное животное, она служит богине Ки гонцом. В Финляндии лисица — символ хитрости, но не зла.

Эта красавица заняла своё место и в геральдике, она — символ проницательности, хитрости, прозорливости.

Лисица имеет большое хозяйственное значение как ценный пушной зверь, при этом истребляет множество грызунов и насекомых — потребителей зерна, является объектом спортивной охоты и служит замечательным украшением природы. Разумеется, лисица — хищник и уничтожает известное количество дичи, но ущерб, который наносится лисицами промысловой дичи и домашним птицам, намного меньше той пользы, которую они приносят, защищая наши поля от грызунов. Однако в странах Западной Европы лисицу считают вредным хищником, подлежащим круглогодичному истреблению. И это вполне оправданно, так как у тамошних зверей мех малоценный, а в спортивных хозяйствах разводят много пернатой дичи, которая страдает от лисиц.

Лисицы, живущие возле туристических троп, пансионатов, в местах, где запрещена охота, быстро привыкают к присутствию человека и даже начинают заниматься попрошайничеством. Однако, дикие лисицы — один из переносчиков вируса бешенства, поэтому необходимо соблюдать определённую осторожность.

Ради меха лисиц разводят в неволе. В конце XIX века искусственно выведена порода серебристо-чёрных (чернобурых) лисиц. Затем, благодаря селекции, у этой породы было значительно улучшено (по сравнению с диким типом) качество меха, а также выведен ряд других цветовых вариаций на её основе: платиновая, бакурианская, дакотская и другие.""",
location_text: """Распространение и местообитания
Ареал обыкновенной лисицы — один из наибольших среди всех млекопитающих. Он охватывает практически всю нетропическую часть северного полушария — Евразию (кроме крайнего юго-востока), Северную Америку (кроме Мексиканского нагорья), крайний север Африки.

На этой обширнейшей территории зверь заселяет практически все природные зоны — леса разнообразного типа, тундру, степь, засушливые области, высокогорья. Живёт она и на «Полюсе холода» в Якутии, и в жарких Аравийских пустынях. Нет лисицы только в арктических пустынях Крайнего Севера, где её нишу занимает песец.

Это «вездесущее» животное предпочитает открытые и слабо заросшие местности с перелесками, оврагами и балками. Условия обитания для неё оптимальны в лесостепи и степи — здесь лиса встречается повсеместно. В обширных лесных массивах, особенно там, где зима продолжительна и многоснежна, она попадается реже. В районах с сухим климатом лису чаще можно встретить по сухим древним руслам рек, покрытых тугайными зарослями. Во многих местах она предпочитает селиться рядом с человеком. В окрестностях больших городов постоянно держится рядом со свалками, которые служат источниками пищи.""",
description_continuation: """Внешний вид и морфология
Лисица очень красивое, стройное животное с характерной длинной заострённой мордочкой. Окраска и размеры этих зверей отличаются большой географической изменчивостью — известно более 25 подвидов. В общем, к северу ареала лисицы становятся крупнее и ярче, к югу — мельче и тусклее окрашенными. У самцов длина тела 50–90 см, высота в плечах 35–50 см, масса от 2,5 до 10 кг, самки несколько меньше. Зимой из-за пышного меха лисица выглядит приземистой, с массивным туловищем, летом — поджарой, высоконогой. Меховой покров густой, летом довольно короткий и грубый, зимой пышный и мягкий.

Лесную лисицу за её яркую раскраску называют «огнёвкой»: сверху она красновато-рыжая, горло и грудь белые, уши с тыльной стороны и передняя сторона ног чёрные, хвост рыжий с белым кончиком. В северных районах с суровыми климатическими условиями часто встречаются лисы с преобладанием в шерсти чёрного пигмента — меланина. «Сиводушками» называют лисиц со спиной серо-бурого цвета, рыже-желтыми боками и тёмно-бурым брюхом; «крестовками» — ещё более тёмных животных, у которых тёмная окраска лап слита с широким «ремнём» на спине; «чернобурками» — зверей со шкурой черно-бурого или черного цвета.

Органы чувств у лисицы аналогичны другим псовым. У неё великолепный слух — за сотню метров она слышит писк мыши. Зрение намного слабее, в основном лисица реагирует на движущиеся предметы, а спокойно стоящего человека не различает, иной раз, и за 10 шагов. Вместе с тем эта хищница обладает великолепной зрительной памятью, замечая возле норы малейшие изменения обстановки. Чутьё у лисы несколько хуже, чем у собаки.
Питание и кормовое поведение
Лисица, хотя и принадлежит к типичным хищникам, питается самой разнообразной пищей. Среди поедаемых ею кормов более 300 видов животных и несколько десятков видов растений. Повсеместно основу её питания составляют грызуны, прежде всего, полёвки. Ест лисица и зайцев, и птиц, в основном, мелких воробьиных, куриных, водоплавающих. На Дальнем Востоке живущие на островах лисы, подобно песцу, промышляют в основном выбросами моря, а во время нерестового хода красной рыбы едят и её. В южных засушливых районах значительную долю рациона составляют рептилии — ящерицы и неядовитые змеи. Во время массового лёта саранчи хищник становится насекомоядным. При недостатке естественных животных кормов лисица систематически нападает на домашнюю птицу. В конце лета — осенью она часто посещает бахчи и виноградники, подбирает упавшие яблоки, груши, алычу, черешню.

Во время охоты на мелких грызунов — «мышкования» — лисица выглядит очень забавно. Увидеть её за этим занятием можно чаще всего зимой, на заснеженном поле. Вошедшая в азарт, она как бы танцует на одном месте, подпрыгивая на задних лапах и с силой ударяя о землю передними. Таким способом хищница выгоняет испуганных грызунов из их нор на поверхность, где и ловит. При этом она иной раз настолько увлекается, что подпускает к себе очень близко. Пойманную мелочь лисица съедает целиком, не останавливаясь. Более крупную добычу она утаскивает в сторону, частично съедает, а остатки закапывает в землю. Если повезёт, у падали или туши зарезанного волками крупного копытного собираются несколько лис. Здесь они живут по нескольку дней. Лисица, в отличие от волка, никогда не наедается «до отвала», обычно ей хватает 300–350 граммов мяса в день. Однако при изобилии мышевидных грызунов хищница не прекращает охоту на них и после насыщения: она не поедает их после поимки, а поймав, играет, подобно кошке.

Вокализация
Голос лисицы — глухой лай или короткий однотонный вой, завершающийся визжащим звуком, напоминающим вопли дерущихся котов.

Образ жизни и поведение
Лисица — достаточно осёдлый зверь, однако, охрана территории ей, по-видимому, не свойственна, и охотничьи участки разных животных перекрываются. На своём участке лисица активно пользуется запаховыми метками, оставляя секрет околохвостовых желёз на ветках и стволах молодых деревьев. Такие метки зверь располагает во многих местах своего охотничьего участка, составляющего до 10–15 км в диаметре. Лисица прекрасно знает свой участок и систематически его обследует. Зимой её суточный ход составляет в среднем 8–12 км. На это расстояние приходится до 4 временных лежек, где она отдыхает, и около 50 мест, где останавливается и присаживается.

Лисица ловко лазает по крутым склонам и хорошо плавает. Может забираться на деревья, если они наклонены или ветвятся низко над землёй. Известен случай, когда лисица спряталась от собак в птичьем гнезде, расположенном на высоте 10 метров над землёй.

Регулярные миграции лисице, в отличие от песца, также несвойственны. Они отмечаются только в тундре, пустыне и горах. Например, одна из помеченных в Малоземельской тундре лисица была добыта в 600 км к юго-западу. Молодые расселяющиеся самочки, покидая родительскую нору, уходят на расстояние до 10–15 км. Лисята-самцы склонны к более длительным путешествиям, уходя от родительской норы на 30–40 км и больше.
Передвигаются лисицы чаще мелкой рысью, при этом задние лапы точно попадают в следы передних и получается крытый след — зверь будто идет по ниточке. Отпечатки тянутся ровной цепочкой, лишь едва смещая центры правых отпечатков вправо от средней линии, а левых влево. Длина шагов 20–40 см, чаще около 30 см. При этом аллюре следы лисиц безошибочно отличаются от следов собак, которые никогда не передвигаются столь ровно.

Активны лисы в основном на рассвете и на закате, но в тех местах, где их не преследуют, охотятся в разное время суток, причем не обнаруживают какого-либо беспокойства при виде людей. В противных случаях лисица отличается крайней осторожностью и удивительной способностью, уходя от погони, запутывать следы и пускаться на всевозможные уловки, чтобы обмануть собак.

Размножение и воспитание потомства
Начало размножения у лисы приходится на середину — конец зимы: на юге это — декабрь, на севере — февраль. В это время звери сильно возбуждены и почти не отдыхают, их «свадьбы» можно видеть среди белого дня. Бывает, одну самку преследуют 5–6 самцов, которые тявкают и дерутся между собой.

После окончания брачного периода звери расходятся и начинают жить самостоятельно. Однако незадолго до рождения малышей самцы вновь принимаются с азартом преследовать самок и вновь сражаются между собой. Подмечено, что не всегда воспитателем лисят становится их настоящий отец. Профессор П. А. Мантейфель, много наблюдавший за лисицами в природе, в зоопарке и на зверофермах, полагал, что в моче беременных лисиц появляется вещество, которое служит возбудителем отцовского инстинкта у самцов. Это очень полезное для выживания вида свойство, так как обеспечивает лисятам внимание и уход обоих родителей.
Перед родами будущая мать чистит нору и большую часть времени проводит в ней. Когда появляются на свет лисята, она практически перестаёт выходить из норы, и лисовину приходится много охотиться, чтобы прокормить и себя, и её. Добычу самец оставляет у входа в нору, причем к детёнышам он не допускается.

От 2 до 12 малышей (в среднем 4–6) появляются на свет весной слепыми, с закрытыми ушными раковинами. Тело покрыто коротким детским пушком тёмно-бурого цвета, но кончик хвоста уже белый. Растут и развиваются они быстро: в двух-трёх недельном возрасте у них открываются глаза и уши, начинают прорезываться зубы. Лисята начинают выползать из норы, пробовать «взрослую» еду, и матери тоже приходится охотиться, чтобы прокормить потомство.

Подобно волкам, лисы, имеющие маленьких детёнышей, не охотятся вблизи норы. Известны случаи, когда егеря систематически наблюдали тетеревиный выводок недалеко от лисьей норы, причем птицы благополучно выросли и поднялись на крыло. Утки-пеганки, живущие в степной зоне, иногда благополучно выводят птенцов не просто поблизости, а в ответвлениях жилых лисьих нор.

Лисята растут, и в месячном возрасте уже встречают у входа в нору родителей, возвращающихся с охоты, подолгу играют. Молочное кормление длится 6–7 недель, в это время малыши начинают пытаться охотиться самостоятельно. С двухмесячного возраста щенки уже отлучаются из «дома», отходя всё дальше и дальше, проявляя все большую самостоятельность. Однако родители до конца лета продолжают их подкармливать, и семья придерживается родной норы. Осенью молодые животные часто переходят к самостоятельной жизни, но бывает, что вся семья на зиму остаётся в выводковой норе.

Некоторые молодые самочки уже на следующий год начинают размножаться и, во всяком случае, достигают половой зрелости к двухлетнему возрасту, самцы обзаводятся потомством на 1–2 года позже.

Продолжительность жизни
В неволе продолжительность жизни до 25 лет, в диком состоянии лишь немногие звери доживают до 8–10 лет.

Содержание животных в Московском зоопарке
Лисицы живут на Старой территории зоопарка в большом вольере рядом с «Кошачьим рядом», напротив красных волков. Как и в природе, животные чаще активны в утренние и вечерние часы, а днём спят, свернувшись калачиком, либо в домиках, либо на них. Когда им дают корм, часть они съедают, а остальное пытаются спрятать. Поскольку лисиц две, каждая опасается, чтобы соседка не нашла её тайничок и перепрятывает еду по много раз. Между собой лисицы живут мирно, а если что-то не нравится в поведении партнёра, то призывают его поддержать дистанцию очень характерной позой. Зверь чуть опускает голову, прижимает ушки, открывает рот и издает своеобразный звук – нечто среднее между поскуливанием и покашливанием. Таким образом, конфликты, если и случаются, то разрешаются мирно.

Одна из лисиц очень пугливая, выходит из домика днём нечасто. Другая людей не боится, может подходить к решётке вплотную, но не пытайтесь её погладить или покормить – укусить может.

Ещё  лисицу можно увидеть в одной из вольер на экспозиции «Фауна России». Есть лисы и на выездной секции зоопарка. Эти животные ездят на лекции в школы, детские сады, музеи, участвуют в праздниках. Вот эти звери совсем ручные. Но для того, чтобы они стали такими, лисята должны попасть в руки дрессировщика совсем маленькими и вырасти в постоянном контакте с людьми. Людям же необходимо приложить очень много терпения, чтобы зверьки, став взрослыми, безгранично доверяли своим «старшим братьям».

