Статус зебры в природе
Состояние саванной зебры в настоящее время не вызывает опасения, но зебре Греви и горной зебре грозит исчезновение. Эти два вида взяты под охрану Международным союзом охраны природы.

Зебры и люди
Безусловно, несколько веков назад зебры были распространены на Африканском континенте значительно шире, чем теперь, а в конце ледникового периода встречались и в Европе. В эпоху римлян зебры попадали на итальянский полуостров, где их называли hippotigris, что значит «лошадь-тигр», и использовали в цирковых представлениях. Однако дрессировать зебр трудно, они плохо приручаются, а от врагов отчаянно защищаются зубами и копытами. Опыты по их приручению и одомашниванию не получили широкого распространения, поскольку и по своим рабочим качествам зебры значительно уступают лошадям и ослам.

Зебры жили в родной стихии в гармонии с окружающей средой до конца 18 века, пока не началась колонизация Африки. Местное население издавна охотилось на них ради мяса и шкур, но лишь жуткие сафари европейских охотников, во время которых погибали сотни животных, привели к резкому сокращению численности африканских копытных, в том числе и зебр. От полного исчезновения некоторые подвиды, и даже виды зебр, были спасены только путем создания сети национальных парков. Даже в настоящее время браконьеры представляют опасность для этих животных, поскольку красивые полосатые шкуры по-прежнему дорого стоят. Кроме того, рост числа людей ведет за собой увеличение количества поселений, площади возделываемых земель и поголовья домашних копытных, что приводит к истощению пастбищ. Именно усилившаяся конкуренция с домашним скотом привела к резкому сокращению численности зебр Греви в конце прошлого столетия.""",
location_text: """Распространение и места обитания
Зебры — типичные обитатели открытых пространств. Африканские саванны занимают более трети поверхности континента. Эти огромные покрытые травой пространства, усеянные кое-где баобабами и акациями, обеспечивают пищей около 40 видов копытных, и зебр в том числе. Однако, вытесненные людьми и домашними животными, зебры в настоящее время обитают только на востоке и юге Африки.
Саванные зебры освоили степи восточной Африки от Кении до Мыса Доброй надежды, где располагается множество заповедников и национальных парков. Обширная охраняемая территория позволяет этим животным широко мигрировать в поисках водопоев и сочных пастбищ.

Зебра Греви обитает в опустыненных степях и засушливых кустарниковых саваннах Эфиопии, Сомали, Сев. Кении. На юге своего ареала зебра Греви встречается совместно с саванной зеброй.
Ареал горной зебры ограничен двумя горными регионами со степным ландшафтом на юго-западе Африки.""",
description_continuation: """Внешний вид и морфология
Облик полосатой лошадки известен людям многих стран с младенчества, поскольку она символ буквы «З» или «Z». Существует несколько различных гипотез, пытающихся объяснить полосатую окраску зебр. Чаще всего говорят о её покровительственной функции: в африканском мареве очертания животных расплываются, и этот эффект усиливается полосатостью. Возможно также, что львам во время охоты на этих животных труднее выбрать жертву в сплошном мелькании черно-белых полос. Биологи полагают, что предки всех лошадиных были полосатыми. Зебры сохранили эту окраску, а у других представителей рода (дикий осёл, лошадь Пржевальского) полосы на теле исчезли, сохранившись, однако, на конечностях. Квагга, ещё один вид лошадиных, вымерший в конце 19 века, имела полосы на ногах, голове и шее.

Пропорции тела у зебр сходны с пропорциями лошадей, но хвост ослиный: длинные волосы растут лишь на его конце, образуя кисточку.

У зебр очень широкое поле зрения: направленное вперёд бинокулярное дополняется монокулярным боковым, что позволяет животному видеть практически всё окружающее пространство. Мёртвая зона составляет лишь направленный назад сектор между ушами животного, в пределах которого зебра не может видеть приближающуюся опасность.

Три вида зебр, существующих в настоящее время на Земле, различаются размерами, формой ушей, рисунком на шкуре. Зебра Греви — самая крупная из них: длина туловища до 275 см, вес около 400 кг. У этой зебры удлиненная голова и большие округлые уши. Конец морды коричневый. Светлая окраска брюха поднимается довольно высоко на бока. Четкие и узкие вертикальные полосы на боках закругляются на крупе.

Коренастая, относительно коротконогая, саванная зебра имеет более широкие черные полосы, заходящие на живот. Конец морды черный, маленькие уши венчают короткую и широкую голову. Длина туловища этого животного 230 см, масса 300 кг.

Горная зебра намного мельче других, длина её туловища 215 см, вес не более 250 кг. У горной зебры длинные уши и есть подгрудник (складка шкуры внизу шеи). Черные полосы на крупе образуют решетку.
Расположение полос на теле каждой зебры индивидуально, особенно в области плеча. Яркие вертикальные полосы на шее продолжаются на короткую стоячую гриву, отчего шея кажется очень толстой.

Образ жизни и социальное поведение
Несмотря на внешнее сходство всех видов зебр, для них характерны два типа социальной организации. Равнинные и горные зебры живут группами постоянного состава, в каждой из которых один жеребец и несколько кобыл с жеребятами в возрасте до 2 лет. Каждая семейная группа занимает определённый участок, который может частично перекрываться с участком соседней группы. Когда жеребец стареет, его сменяет другой, более молодой самец, а старый уходит в группу холостяков или остается одиночкой. Социальные связи между самками достаточно прочны, чтобы не распадаться при смене вожака гарема.

Для зебры Греви характерен другой тип социальной организации. Группировки взрослых особей менее устойчивы. Большинство взрослых самцов держится по одиночке, бродя по обширным территориям, площадь которых составляет до 10 кв. км. В пределах границ этих участков, которые помечаются большими кучами навоза, их владельцы присваивают себе исключительное право спариваться с заходящими туда самками. В обоих вариантах социальных систем молодые самцы, или самцы, оставшиеся без гарема, живут холостяцкими группами, не имея определённой территории и перемещаясь очень широко.

Питание и кормовое поведение
Все лошадиные питаются грубоволокнистой растительной пищей, и зебры — не исключение. В их рационе в основном различные травы, в том числе и осоки, они не откажутся также от древесной коры, листьев, почек и корневищ. Двигаясь по пастбищу зебры срезают верхнюю часть травы, в основном злаков, облегчая доступ к нижним, наиболее питательным частям растений многочисленным африканским парнокопытным. Однако когда мелкие копытные попадают на участок растительности, где пасутся крупные, они выедают лучшие части растений, что вскоре снижает общее качество пастбища. Крупные копытные не могут прогнать более мелких, а просто идут дальше, ведя тех за собой.

Питание низкокалорийной пищей вынуждает животных тратить на пастьбу до 15 часов в сутки. В жаркий сезон зебры предпочитают пастись в прохладные часы перед восходом и после захода солнца, используя полуденное время для отдыха. Напротив, в сезон дождей они обычно кормятся днём.

Вода играет ключевую роль в определении суточной, сезонной, да и территориальной активности. Зебры нуждаются в водопое как минимум раз в сутки, а кормящие кобылы и того чаще. Особенно тяжело найти воду в засушливый период. Когда реки пересыхают, а небольшие водоёмы превращаются в грязь, своими крепкими копытами зебры выкапывают ямы глубиной до 50 см и диаметром до 1 метра. Вода, просачиваясь сквозь песок, накапливается в яме, и животные могут её пить. Когда высыхают и эти «колодцы», начинаются массовые миграции крупных копытных, в первую очередь зебр, в поисках пастбищ со свежей травой. Животные перемещаются иногда на сотни километров, сбиваясь в огромные табуны и вновь рассредоточиваясь на свежих пастбищах.

Размножение и развитие
Молодые зебры достигают половозрелости к 2 годам, однако, в этом возрасте приходят в охоту и начинают размножаться только самки. Самцы допускаются к размножению более взрослыми особями своего пола не раньше, чем в 4–5 лет. К этому возрасту молодые жеребцы становятся способны удержать около себя самок и противостоять соперникам. Размножение приурочено к влажному сезону, когда шансы выжить на пастбищах с обильным кормом у молодняка выше. Поскольку продолжительность беременности 12 месяцев, а самки готовы принять ухаживания самцов уже через 7 — 10 дней после родов, то малыш может появляться у каждой самки ежегодно. Однако часто это происходит лишь раз в два года.

Когда единственному детёнышу приходит время появиться на свет, самка либо старается уединиться, пользуясь небольшой складкой рельефа, как это происходит у зебры Греви, либо счастливое событие наблюдает семейная группа (саванная и горная зебры). Роды длятся около получаса. Вскоре после того, как жеребёнок появился на свет, кобыла поднимается, пупочный канатик рвётся, мать поворачивается к детёнышу, внимательно обнюхивает его и собирает губами околоплодную жидкость. Малыш практически сразу же делает попытки встать на ноги, но удается это ему лишь минут через 15–20. В это время происходит первое сосание, после чего детёныш ложится и отдыхает. Через 2–3 часа он уже в состоянии следовать за матерью.
Первое время самка отгоняет от малыша других зебр, но через неделю он знакомится со всеми членами группы. Примерно в это же время мать готова к спариванию. У малыша наступают трудные дни, поскольку он стремится быть всё время рядом с матерью, подвижность которой возрастает. Если у кобылы наступает беременность, то кормление молоком прекращается через 6–7 месяцев. Если нет, то мать может кормить жеребёнка больше года.

Продолжительность жизни
Живут зебры до 25 -30 лет, редко дольше. В природе срок жизни у них короче.

Зебры в Московском зоопарке
Зебры содержатся в зоопарке едва ли не с момента его основания. В разные годы в зоопарке жили и успешно размножались различные подвиды саванной зебры. Особо знаменита саванная зебра (подвид — зебра Чапмана) по кличке Венера, которая поступила в зоопарк в 1970 году в возрасте 3 лет вместе со своим ровестником самцом Марсом. До 1981 года (когда Марс погиб) она родила шестерых детёнышей и умерла в 2000 году, прожив необычно долгую для зебры жизнь — 33 года.

Зебры прекрасно переносят московские зимы. Слякоть они не любят, а вот морозы им нипочем — гуляют и при -30 градусах.

С 1993 года на экспозиции можно увидеть зебр Греви. Они содержатся в павильоне «Копытные Африки» на Новой территории зоопарка. Рядом с павильоном большая поляна, где зебры гуляют вместе с южноафриканским жирафом и страусом. Зимой зебр переводят под крышу и отделяют от других животных, поскольку в небольшом помещении при возбуждении животные могут травмировать друг друга. Сейчас в зоопарке живут две самки и один самец зебры Греви. У них были жеребята, самочки, но создать большую группу зебр не удалось. В природе повзрослевшие дочери уходят из родительской группы, причем их побуждает к этому отец. Видимо, таким образом природа препятствует инбридингу. В одной, даже большой вольере зоопарка, скрыться негде, и самец начал проявлять в отношении дочерей такую сильную агрессию, что их пришлось отсадить. Позже молодых животных отправили в другой зоопарк, где они уже обзавелись собственным потомством."""
