description: """ Льва называют царём зверей. Он и вправду ведёт царскую жизнь — основными добытчиками в прайде являются львицы, однако, первым к еде приступает самец.

Систематика

Русское название — Индийский (азиатский) лев
Латинское название — Pantera leo persica
Английское название — Asian lion
Отряд — Хищные (Carnivora)
Семейство — Кошачьи (Felidae)
Род — Крупные кошки (Panthera)

  В настоящее время не существует единого мнения о количестве подвидов льва: африканских хищников одни исследователи разделяют на несколько подвидов, другие считают одним подвидом. Однако все выделяют в отдельный подвид львов, обитающих на Азиатском континенте.

  Данные генетического анализа показывают, что общий предок азиатских и африканских львов жил около 100 тыс. лет назад.
  В зоопарке в настоящее время содержатся львы азиатского подвида.

Статус вида в природе

  Львы взяты под охрану Международным союзом охраны природы, а азиатский подвид занесён в Красную книгу как находящийся под угрозой исчезновения, в настоящее время в дикой природе осталось всего несколько сотен этих животных — IUCN (EN). Подвид азиатского льва включен в Конвенцию о международной торговле видами дикой фауны и флоры — CITES (I).

Вид и человек

  Красота, величие, сила льва издревле поражают воображение человека: он страшится царственной кошки и восхищается ею. Изображение льва присутствует уже в наскальных росписях, созданных первыми людьми. 3000 лет назад египтяне ваяли изображение львов на своих барельефах и могильных плитах фараонов. Лежащий лев с человеческой головой — грозное и загадочное существо сфинкс, воплощение бога-солнца и хранителя священных могил в Египте.

  Многих персидских царей изображали на троне в окружении ручных львов. В античном Риме льва использовали как символ силы: запряженные в колесницы победителей, львы участвовали в их триумфах; у Помпея их было шесть сотен, у Цезаря — четыре сотни. Гладиаторы сражались со львами на аренах.

  Многие доблестные рыцари Средневековья избрали изображение этого символа отваги для своих гербов. В конце XII в. король Англии Ричард I был прозван Ричардом Львиное Сердце. В Европе создавались рыцарские ордены Льва или Львицы. На гербах королевств Англии, Шотландии, Норвегии, Дании и отдельных городов изображен лев.

  Лев стал также символом первозданной, дикой красоты для таких великих художников, как Дюрер, Рембрандт, Делакруа.

  Лев — частый персонаж литературных произведений. Три десятка басен грека Эзопа изображают льва. Сегодня он ещё и живой символ для людей, рождённых под зодиакальным созвездием льва.

  Лев остаётся звездой цирков и зверинцев, неизменно вызывая огромный интерес публики.

  Люди часто умышленно обвиняют львов в людоедстве, чтобы безнаказанно убивать их, невзирая на защиту закона. Иногда львы действительно нападают на людей, но лишь раненые, либо ослабленные и старые, неспособные охотиться. Людоедами могут стать и здоровые львы, лишенные нормальной среды обитания, но, обычно, встретив человека, зверь просто уходит. В местах, где много туристов, лев не делает даже этого, спокойно продолжая отдыхать и заниматься своими делами.""",
location_text: """Распространение и места обитания
  Несколько тысячелетий назад львы были распространены гораздо шире — их ареал простирался по всей Африке и далее на восток до Индостана. Они водились даже на юге Европы, в частности, на Кавказе. Из-за преследования человеком ареал этого замечательного зверя неуклонно сокращался, ныне лев сохранился только в Центральной Африке и на полуострове Индостан, в индийском штате Гуджарат, в Гирских лесах, где живёт азиатский подвид льва.

  В Африке львы благоденствовали до начала 20 века, пока не начались безумные сафари европейских охотников с истреблением огромного количества животных. Численность азиатских львов начала уменьшаться особенно быстрыми темпами раньше, в 19 в., в связи с появлением огнестрельного оружия. К 1884 г. осталась только одна небольшая популяция этих животных на западе полуострова Индостан. В 1900 г. владелец основной части Гирского леса, где сохранились львы, наваб Джунагадха провозгласил их охрану. Численность львов утроилась и через 36 лет составила 286 особей. В настоящее время в природе индийские львы живут только в заповеднике «Гирский лес». Их численность не превышает 200 особей.

  Для всех львов наиболее благоприятны саванны с их открытым ландшафтом, обилием разнообразных копытных и наличием водопоев. Каменистые островки служат им прекрасными наблюдательными пунктами. Отдельные деревья с зонтиковидными кронами обеспечивают их необходимой тенью. В то же время эти животные весьма пластичны и могут приспособиться к любой среде, если там хватает дичи и воды: пока не началось их повальное истребление, львы жили и на жарких побережьях, и в полупустынях, и в предгорьях.
""",
