  Облик этой крупной своеобразной кошки известен нам с детства: мощный песочной окраски зверь с роскошной гривой, царственным видом и голосом. Обладателями гривы являются лишь самцы, которые крупнее стройных мускулистых самок на 20–50%. В длину самцы африканского льва достигают 180–240 см, не считая хвоста (60–90 см), масса тела от 180 до 227 кг. Азиатские львы мельче, взрослый самец весит 160–90 кг, самка до 120 кг. Тело хищника мощное, но вместе с тем и поджарое. Голова массивная, с довольно длинной мордой. Лапы невысокие, очень сильные. Хвост длинный, оканчивается пучком густых черных волос, которые скрывают роговое утолщение-шпору, длиной от 6 до 12 мм. Обмахиваясь хвостом, львы защищаются от мух, которые сильно им докучают. Шерсть, покрывающая тело льва, короткая, буровато-желтоватая. Грива, сначала светлая, у молодых самцов начинает отрастать в 2 года. С возрастом она темнеет и меняется от рыжеватого до черного цвета, проходя через рыжий и коричневый. У разных особей она отличается не только цветом, но и пышностью. У львов азиатского подвида грива не столь пышная и густая, как у африканцев.
Образ жизни и социальное поведение

  Львы — единственные кошки, которые живут социальными группами (прайдами). Основу прайда составляют несколько львиц, как правило, это близкие родственницы, имеющие свою территорию (дочери наследуют территорию матерей). Между львицами отношения дружеские и не иерархические. Самцов в группе может быть несколько, (чаще всего это братья) и, если их больше одного, выделяется доминант, первенство которого другие львы признают и не оспаривают. Он первым ест после удачной охоты, первым спаривается с самками, первым атакует врага — льва, вторгшегося на территорию прайда.

  В среднем в прайде африканских львов около 13 животных, но может быть и до 40. Азиатские львы менее социальны, чем африканские. В прайде у них, как правило, лишь две самки. Самцы этого подвида живут с самками только в период спаривания или когда вместе выходят на большую охоту. Это случается нечасто, так как обычная добыча в Гирском лесу мелкая (индийский олень и замбар), хотя традиционной для азиатского льва является охота на более крупных животных. Возможно, эта особенность и является причиной уменьшения размеров прайда.

  Прайд сохраняется в течение нескольких лет. Львицы вместе охотятся и воспитывают детёнышей. Самцы обеспечивают защиту территории: они метят её смесью мочи и выделений анальных желёз и обозначают грозным рычанием. Если для чужаков этого недостаточно, хозяину территории приходится вступать в бой. Схватки между одинаково сильными противниками могут заканчиваться гибелью обоих.

  Прайд придерживается определённой территории, размер которой зависит от ландшафта, количества потенциальной добычи и величины группы и может колебаться от 20 до 400 кв. км.

  Молодые самцы, достигнув 2 — 3 летнего возраста, покидают семью, иногда этому способствует «глава» прайда. Они уходят поодиночке, а чаще по две-три особи одного возраста, и становятся кочевниками. Такие животные бродят неподалеку от других прайдов, дожидаясь проявления признаков слабости или старости у самцов, на место которых они претендуют. Группе молодых львов легче захватить прайд, чем одинокому льву, и затем легче его оборонять: если пара самцов удерживает прайд в пределах 2,5 лет, то коалиция из 3–4 самцов — более трёх лет.

  Первое, что делает самец, захватив прайд, — убивает маленьких львят. Львицы, как правило, не в состоянии помешать, и шансы на спасение есть только у львят старше года. У львицы, потерявшей львят, через 2–3 недели начинается эструс, она становится лояльна к новому вожаку и вскоре рожает от него детёнышей. Такой инфантицид (убийство детёнышей) позволяет самцам вырастить собственное потомство, в противном случае, а сменяются вожаки каждые 2–4 года, они бы просто не успели это сделать.

Питание и кормовое поведение

  В дневное время львы преимущественно отдыхают где-нибудь в тени, а вечером выходят на охоту. Добычей им обычно служат различные антилопы, зебры и бородавочники. 80–90% всех жертв добывают львицы. Более грузные и заметные из-за своей тучности и пышной гривы самцы не так удачливы и редко участвуют в охоте, однако, к еде приступают первыми, отгоняя самок и детёнышей. По данным Дж. Шаллера, 75% пищи самцов составляет добыча, отобранная у самок, 12% — отнятая у других хищников, и лишь 13% — та, которую они убили сами. Львицы прайда охотятся сообща, и их действия во время охоты выглядят очень скоординированными.

  В целом, только четверть нападений приносит удачу. При том, что самке ежедневно требуется 5 кг мяса, а самцу — 7 кг, львы могут 2–3 дня оставаться без пищи. Когда же охота бывает удачной, они способны съесть за раз 20, а то и 30 кг мяса. После еды, а порой и во время особенно обильного пиршества львы обязательно утоляют жажду. Они отходят по одному, чтобы напиться, оставляя добычу на попечение остальных членов группы.

  Во время засухи, когда большинство копытных мигрирует в поисках воды, львы нападают на мелких млекопитающих, птиц, змей, крокодилов. Им приходится поедать даже трупы животных, умерших от болезней, или подбирать объедки других хищников. Система распределения пищи подчиняется праву сильнейшего, и в сухой сезон члены группы дерутся за каждую косточку.

Вокализация

  Говорят, что львиный рык — самый ужасающий и грандиозный из всех криков диких животных. При благоприятных условиях его слышно на расстоянии 8–9 км. Чаще всего львы ревут на закате солнца, провозглашая, что участок, на котором они находятся, занят.

Размножение и выращивание потомства

  Период спаривания у львов не приурочен к определённому времени года, но чаще это происходит в сезон дождей. Имеются также сведения, что львята в одном прайде бывают, как правило, приблизительно одного возраста. Беременность у львиц длится от 102 до 110 дней. Перед родами львица несколько отдаляется от прайда и, в каменистом убежище, в густых зарослях, или в высокой траве производит на свет от 2 до 4 детёнышей.

  Львята рождаются слепыми и весят менее 2 кг при длине около 30 см. Окраска у них в это время пятнистая, которая впоследствии становится однотонной. В возрасте 6 недель львята уже резвятся вокруг логова и впервые пробуют «взрослую» пищу. В эти первые недели самка всегда настороже и бдительно охраняет своё потомство. Из осторожности она меняет убежище каждые 3–4 дня и переносит львят по одному, держа их за холку.

  В возрасте 10 недель львята вместе с матерью возвращаются в свою группу. Часто львица кормит молоком как своих, так и чужих детёнышей. Случалось, что львята от четырёх матерей сосали вместе одну и ту же львицу. Бывает, что молодых львят-сирот принимают самки другого прайда. Львы-отцы очень доброжелательно относятся к своим маленьким и очень ласковым сыновьям и дочерям.

  С 14 недель молодые львята сопровождают самок на охоте. Оставаясь в отдалении, иногда в компании самцов или старых самок, они наблюдают за охотящимися животными. В годовалом возрасте они уже могут самостоятельно убивать добычу. Однако до самостоятельной жизни ещё далеко: львёнок имеет шансы выжить в одиночестве, начиная с 16 месяцев, но обычно не оставляет прайд до 3, а то и 4 лет. Молодые самки вообще остаются в прайде.

Продолжительность жизни

  Львицы в природе живут дольше самцов, так как в определённой степени находятся под защитой прайда. Самцы же, потеряв силу, вынуждены покидать прайд и проводить остаток жизни в одиночестве в менее благоприятных условиях. Средняя продолжительность жизни самок 14–16 лет, самцы редко доживают до 11–12 лет.

  Рекордная продолжительность жизни в неволе — 30 лет.

Содержание животных в Московском зоопарке

  Львов в Московском зоопарке держат с момента его основания. Однако «азиаты» появились у нас сравнительно недавно — в 1995 году. Из Англии привезли молодую самочку, из Финляндии самца. К сожалению, семейная жизнь у них не сложилась, несмотря на очень покладистый характер самки. Нрав у этого «царя зверей» оказался отвратительным: он принялся всячески притеснять свою партнёршу, вплоть до того, что не подпускал её к еде, даже будучи сытым. По-видимому, сказалось то, что у него не было опыта общения с сородичами: мать сразу после рождения отказалась кормить детёныша, и приёмными родителями стали люди. Увы, в зоопарках это не редкость. Пришлось наших львов содержать порознь.

  Через пару лет наш «женоненавистник» уехал в другой зоопарк, а из зоопарка Голландии прибыл другой самец, вальяжный и мирный, тоже родившийся в неволе, но выросший с родной мамой. Однако, имея отрицательный опыт общения с «главой семейства», львица «решила» не связываться с представителем другого пола. Нам так и не удалось их подружить. Эти животные также разъехались по другим зоопаркам, где люди смогут увидеть такой редкий подвид льва — азиатский.

  В 2013 году в наш зоопарк прибыл очаровательный азиатский львёнок по имени Кувам, а через год — и подруга для него. Когда животные стали взрослыми, их ссадили, и наконец, весной 2015 года родились львята. Львица оказалась хорошей мамой, и счастливое семейство можно увидеть на Новой территории на «Острове зверей». Гуляют львы часто, уличный вольер они любят, и даже небольшой морозец им не страшен.

  Если же вы подошли и не увидели львов, они находятся во внутреннем помещении и «царя зверей» можно услышать. Самец примерно раз в полтора часа издаёт свой грозный рык, сигнализирующий о том, что территория занята. Если лев возбуждён, то рычит чаще. В этом случае сигнал чаще адресуется тигру — соседу по внутренней вольере. Львица значительно более молчалива.

  Кормят львов в зоопарке в основном говядиной, дают ещё кур и кроликов. При этом крольчатину они предпочитают всему остальному.

