description_continuation: """Внешний вид и морфология
Гепардов легко отличить от любых других кошек не только по специфическому рисунку на шкуре, но и по поджарому туловищу, небольшой голове и длинным, тонким, но вместе с тем сильным, ногам. Длина тела этих животных 123–150 см; длина хвоста 63–75 см; высота в холке около метра; масса обычно 50–65 кг. Когти не втягиваются в подушечки лап — эта характерная особенность отличает гепардов от других кошек. Такое строение когтей обеспечивают гепарду прекрасное сцепление с поверхностью почвы во время бега. Когти первых пальцев на передних лапах остаются всегда острыми, так как никогда не соприкасаются с землёй. Именно с их помощью хищник сбивает с ног добычу.

