Образ жизни и социальная организация
Гепард, как правило, активен днём, когда другие крупные хищники отдыхают. Реже он выходит на охоту в сумерках. Таким образом он в некоторой степени избегает конкуренции со львами и гиенами.

Гепард хоть и особенная кошка, но всё-таки кошка, и основную, взрослую часть жизни, он, как и большинство других кошек, проводит в одиночестве. Молодёжь остаётся с матерью до возраста 17–20 месяцев. Почти достигнув половой зрелости, молодые гепарды одного помёта всё еще держатся вместе в течение не менее полугода. В обществе братьев и сестёр они чувствуют себя в большей безопасности. Затем сёстры по одной покидают группы, тогда как их братья остаются жить ещё некоторое время вместе.

Гепарды не имеют территории, если под ней понимать активно охраняемый участок. Они скорее следуют за перемещениями своих жертв, однако, активно метят свои маршруты экскрементами. Имеются данные о том, что если гепард встречает метку, оставленную менее 24 часов назад, он тотчас отправляется в противоположном направлении от маршрута прошедшего здесь ранее сородича. Одному гепарду необходимо жизненное пространство от 50 до 150 кв. км. Самая высокая плотность этих хищников наблюдается в национальном парке Найроби — одна особь на 5–6 кв. км.

У гепардов очень своеобразная вокализация. Звуки, которые они издают, очень разные: и мяуканье, и шипение, и фырканье. В брачном поведении в репертуаре самца присутствует характерное «трещание» — звук, скорее напоминающий птичью позывку.

Питание и кормовое поведение
Гепарды охотятся преимущественно на копытных: мелких антилоп, газелей, иногда ловят зайцев, детёнышей бородавочников и птиц. У гепарда острое зрение, он издалека видит свою потенциальную добычу. Сначала он её скрадывает, а затем преследует, развивая скорость до 60 км/час уже через 2- 3 секунды после старта. Считается, что гепард может бежать со скоростью более 100 км/час. Догнав свою жертву, хищник своим единственно острым когтем на передней лапе подцепляет её и хватает зубами.

Гепард недаром считается самым быстроногим млекопитающим на Земле, однако, если погоня продолжается больше минуты, он прекращает преследование. Его организм сильно перегревается от такого мощного энергетического выброса, и животное вынуждено отдыхать. Иногда гепарды подкарауливают свою добычу около водопоев. Молодые самцы, покинувшие родительский участок, охотятся сообща, и могут добыть даже крупное животное. Гепард — прекрасный охотник, начав преследование, он добивается успеха почти в половине случаев (в отличие от льва и леопарда, у которых процент успешных охот колеблется от 10 до 30). В то же время гепардам приходится уступать добычу более крупным, или многочисленным хищникам: львам и гиенам. Иногда еду у них отбирают даже грифы. Гепарды никогда не питаются падалью, они не возвращаются даже к остывшим остаткам собственной добычи.

Как часто охотится гепард? Это зависит от обстоятельств. Самка, имеющая малышей, вынуждена охотиться каждый день, а взрослое животное, ведущее одиночный образ жизни, довольствуется добычей одной газели раз в 2–3 дня. Обычно суточная потребность в мясе не превышает 3 кг.

Размножение и воспитание потомства
Половая зрелость наступает в возрасте 21–22 месяцев. Сезонность в размножении гепардов выражена слабо и зависит от географического положения места обитания животных. Так в Восточной Африке детёныши рождаются преимущественно с января по август, а в Южной Африке — с ноября по март, в то время, когда в данной местности численность потенциальной добычи максимальна.

Самец держится с самкой только несколько дней. Спариваниям предшествует короткий период ухаживания, пока самка не привыкнет к самцу и не позволит приблизиться к ней. После спариваний самец покидает самку и в воспитании молодняка участия не принимает.

Беременность у гепардов длится 90–95 дней. В помёте обычно бывает 3–4 детёныша, каждый из которых весит от 150 до 300 г. Детёныши рождаются слепые и беззащитные и находятся в полной зависимости от матери. В первые месяцы жизни они чрезвычайно уязвимы: взрослыми становится лишь треть родившихся малышей. Пока детёныши не могут сопровождать мать на охоте, она часто переносит их за собой, держа во рту. Это мудрая предосторожность, так как вокруг того места, где растут малыши, быстро накапливаются отбросы и концентрируются запахи. Сопровождать мать детёныши начинают в пяти-восьминедельном возрасте. Молочное вскармливание у гепардов длится около трёх месяцев. Пока самка ходит на охоту одна, детёныши прячутся в густой траве в том месте, где она их оставила. Держатся с матерью детёныши до возраста 17–20 месяцев — за это время она обучает их всем премудростям жизни.

Продолжительность жизни
В природе в среднем гепарды живут 3–4 года, у них очень велика смертность молодняка в результате нападения хищников, прежде всего, львов и гиен. В неволе гепарды могут доживать до 20 лет. В Бухарском питомнике самка гепарда прожила 27 лет.

Содержание животных в Московском зоопарке
Гепарды в Московском зоопарке содержатся с давних времён, причем наш зоопарк — один из очень немногих, в котором гепарды неоднократно приносили потомство.

Впервые детёныши родились в 1980 г. от родителей, приехавших из Африки. Самка и самец жили в одной вольере, и сотрудники не отсадили самца заранее, детёныши родились в его присутствии. Папа удивился, однако, к счастью, никакой агрессии по отношению к детям не проявил, хотя в природе самец гепарда, особенно голодный, бывает опасен для малышей. Эта пара гепардов долго жила в зоопарке, неоднократно приносила и выращивала потомство. Были у них и внуки. Самки гепардов нашего зоопарка были хорошими мамами, но некоторые, из-за беспокойства со стороны людей, не оказывали своим детёнышам должного внимания, и сотрудникам приходилось брать на себя родительские заботы. Некоторые из молодых гепардов разъехались в другие зоопарки, кто-то прожил свою жизнь здесь. Зоопарки всего мира активно обмениваются животными, чтобы избежать близкородственного скрещивания, что особенно актуально для гепардов — у этих животных крайне однообразный генотип.

В настоящее время гепарды живут в Московском зоопарке на Старой территории рядом с Домом жирафа. Здесь создан для них комплекс вольер, есть животные обоих полов, но они живут рядом, поэтому, к сожалению, отношения между самцом и самками чисто дружеские, и детёныши не рождаются. Такой феномен давно известен, в специализированных питомниках по размножению гепардов самцов держат вдали от самок, соединяют пары лишь на время. Гепарды успешно размножаются в зоопитомнике зоопарка, где учтены эти особенности животных.

Гепарды — животные, довольно сложные для содержания — они выносливые и уязвимые одновременно. Для них не страшны несильные морозы, но они не выносят сквозняков и резких перепадов температур. Гепарды могут гулять под дождём, но во внутреннем помещении обязательно должно быть сухо (не больше 45% влажности). Осенью и весной гепарды часто болеют респираторными заболеваниями. Очень опасна для этих животных, особенно в маленьком возрасте, панлейкопения, носителями которой могут являться домашние кошки, поэтому всем гепардам обязательно делают прививки. Гепарды доброжелательно относятся к людям, однако, очень волнуются, если в служебное помещение заходит незнакомый человек.

