Область распространения и места обитания
Область распространения бурого медведя очень обширна, охватывает всю лесную и лесотундровую зоны Евразии и Северной Америки, на севере простирается до границы лесов, на юге по горным областям доходит до Малой и Передней Азии, Тибета, Корее. В настоящее время ареал вида, некогда сплошной, значительно сократился до более или менее крупных фрагментов. Зверь исчез на Японских островах, в горах Атласа на северо-западе Африки, на большей части Иранского нагорья, на обширнейшей Центральной равнине в Северной Америке. В Западной и Центральной Европе этот вид остался только в небольших горных областях. На территории России область распространения изменена в меньшей степени, по-прежнему зверь достаточно обычен в лесах Сибири и Дальнего Востока, на русском Севере.

Бурый медведь – типичный лесной обитатель. Чаще всего он встречается в обширных таёжных массивах, изобилующих буреломом, моховыми болотами и расчленённых речками, а в горах – ущельями. Предпочтение зверь отдает лесам с темнохвойными породами – елью, пихтой, кедром. В горах он живёт среди широколиственных лесов, или в арчевниках.



Внешний вид и морфология
Бурый медведь – очень крупный массивный зверь, один из самых больших наземных хищников. В пределах семейства бурый медведь уступает в размерах лишь белому. Самые крупные из бурых медведей живут на Аляске, их называют кодьяки, длина тела кодьяков достигает 250 см, высота в холке 130 см, вес до 750 кг. Лишь немного уступают им в размерах медведи, обитающие на Камчатке. В средней полосе России вес «типичных» медведей составляет 250-300 кг.

Сложен бурый медведь в целом пропорционально, массивный вид придают ему густой мех и медлительность движений. Голова у этого зверя тяжелая, лобастая, не такая вытянутая, как у белого. Губы, как и нос, черные, глаза маленькие, глубоко посаженные. Хвост очень короткий, целиком скрыт в мехе. Когти длинные, до 10 см, особенно на передних лапах, но мало изогнуты. Мех очень густой и длинный, особенно у зверей, живущих в северной части ареала. Окраска обычно бурая, но у разных животных может варьировать от почти черной до соломенно-желтой.

