Бурые медведи, в отличие от белых,  в большинстве своём осёдлы. Каждый индивидуальный участок, занятый одним зверем, может быть весьма обширен, и охватывать  площадь до нескольких сот кв. км. Границы участков обозначены слабо, а в сильно пересеченной местности практически отсутствуют. Участки самцов и самок перекрываются. В пределах участка есть места, где зверь обычно кормится, где находит временные убежища или залегает в берлогу.

В местах постоянного обитания медведей их регулярные перемещения по участку обозначены хорошо заметными тропами. Они похожи на людские тропинки, только в отличие от них вдоль медвежьих троп на ветвях нередко висят клочки медвежьей шерсти, а на стволах особо приметных деревьев остаются медвежьи метки – закусы зубами и кора, ободранная когтями на той высоте, до которой может дотянуться зверь. Такие метки показывают другим медведям, что участок занят. Тропы связывают между собой места, где медведь гарантированно находит пищу. Медведи прокладывают их по наиболее удобным местам, выбирая кратчайшее расстояние между значимыми для себя объектами.

Оседлый образ жизни не мешает медведю совершать сезонные кочевки в места, где в данный момент пища более доступна. В неурожайные годы в поисках кормных угодий медведь способен пройти 200-300 км. В равнинной тайге, например, лето звери проводят на полянах, заросших высокотравьем, ранней осенью стягиваются к болотам, куда их привлекает созревшая клюква. В горных районах Сибири они в это же время перебираются в зону гольцов, где находят изобилие орехов кедрового стланика и ягод брусники. На Тихоокеанском побережье во время массового хода красной рыбы звери издалека приходят к устьям рек.

