Питание и кормовое поведение
Бурый медведь – настоящее всеядное животное, поедающее больше растительных, чем животных кормов. Труднее всего прокормиться медведю ранней весной, когда растительной пищи совершенно недостаточно.  В это время года он охотится на крупных копытных, поедает падаль. Тогда же он раскапывает муравейники, добывая личинок и самих муравьев. С начала появления зелени и до массового созревания различных ягод медведь большую часть времени жирует на «медвежьих пастбищах» - лесных полянах и лугах, поедая зонтичные (борщевик, дудник), осот, черемшу. Со второй половины лета, когда начинают поспевать ягоды, по всей лесной зоне медведи переходят на питание ими: сначала черника, малина, голубика, жимолость, позже брусника, клюква. Осенний период, наиболее важный для подготовки к зиме, - время поедания плодов деревьев. В средней полосе это желуди, орехи лещины, в тайге - кедровый орех, в горных южных лесах – дикие яблоки, груши, черешня, тутовник. Излюбленная пища медведя ранней осенью – поспевающий овес.

Поедая траву на лугу, медведь мирно «пасется» часами, словно корова или лошадь, или собирает понравившиеся ему стебли передними лапами и отправляет их в рот. Взбираясь на плодоносящие деревья, этот сластена обламывает ветки, объедая плоды на месте, или сбрасывает их вниз, иногда просто обтрясает крону. Менее ловкие звери пасутся под деревьями, подбирая упавшие плоды.

Бурый медведь охотно копается в земле, добывая сочные корневища и почвенных беспозвоночных, переворачивает камни, извлекая и поедая из-под них червей, жуков и другую живность.

Медведи, живущие по рекам у Тихоокеанского побережья, - заядлые рыболовы. Во время хода красной рыбы они десятками собираются у перекатов.  Занимаясь рыбной ловлей медведь заходит по брюхо в воду и сильным быстрым ударом передней лапы выбрасывает на берег подплывшую близко рыбину.

Крупных копытных – оленя, лося – медведь скрадывает, совершенно бесшумно подбираясь к жертве с подветренной стороны. Косуль иногда подкарауливает в засаде у троп или на водопое. Нападение его стремительно и почти неотразимо.

Размножение и выращивание потомства
Брачный сезон у медведей начинается в мае-июне. В это время самцы преследуют самок, ревут, ожесточённо дерутся, иногда со смертельным исходом. В эту пору они агрессивны и опасны. Сформировавшаяся пара ходит вместе около месяца, причем, если появляется новый претендент, его отгоняет не только самец, но и самка.

Медвежата (обычно 2) родятся в берлоге в январе, весят всего около 500 г, покрыты редкой шерсткой, с закрытыми глазами и ушами. Ушные отверстия у медвежат намечаются к концу второй недели, ещё через 2 недели открываются глаза. Все свои первые 2 месяца жизни они лежат под боком у матери, очень мало двигаясь. Сон у медведицы не глубокий, поскольку ей нужно ухаживать за детёнышами. К моменту выхода из берлоги медвежата достигают размера небольшой собачки, весят от 3 до 7 кг. Молочное кормление длится до полугода, но уже в 3-месячном возрасте молодые животные начинают постепенно осваивать растительные корма, подражая матери.

Весь первый год жизни медвежата остаются с матерью, проводя с ней в берлоге ещё одну зиму. В 3-4 летнем возрасте молодые медведи становятся половозрелыми, но полного расцвета достигают лишь в возрасте 8-10 лет.

Продолжительность жизни
В природе около 30 лет, в неволе они доживают до 45-50 лет.

Содержание животных в Московском зоопарке
Бурые медведи содержатся в зоопарке с года его основания – 1864.  До недавнего времени они жили на «Острове зверей» (Новая территория) и в Детском зоопарке. Мишку из детского зоопарка в начале 90-х годов привез в подарок первому президенту России Б.Н.Ельцину губернатор Приморского края. Президент благоразумно не стал держать «эту зверушку» дома, а передал в зоопарк. Когда шла первая реконструкция, медведь временно покидал Москву, гостил в другом зоопарке, а потом вернулся. Сейчас идёт вторая реконструкция, и медведь опять уехал из Москвы, на сей раз в зоопарк Великого Устюга, где и останется жить постоянно.

В настоящее время в зоопарке один бурый медведь, который живёт на «Острове зверей». Это пожилая самка камчатского подвида, классической бурой окраски, очень крупная. Всю зиму она крепко спит в своей берлоге, несмотря на шумную жизнь мегаполиса. Зимнюю «квартиру» помогают обустраивать люди: дно «берлоги» выстилается хвойными ветками, поверх – перина из сена. Перед тем как уснуть медведи и в природе, и в зоопарке едят хвою – в кишечнике образуется бактерицидная пробка. Разбудить зверей может скорее не шум, а длительное потепление, как это случилось зимой 2006-2007 года.

Условия неволи бурые медведи переносят хорошо, но, конечно, скучают, ведь в природе они основное время проводят в поисках и добывании еды, чего не приходится делать в зоопарке. Обязательные атрибуты в медвежьей вольере – стволы деревьев. Мишки дерут их когтями, оставляя свои метки, пытаются искать под корой и в древесине еду, наконец, играют бревнами небольшого размера.  А ещё от скуки медведи начинают взаимодействовать с посетителями. Например, наша медведица садится на задние лапы, а передними начинает махать людям. Все вокруг радуются и кидают ей в вольер самые разнообразные предметы, чаще всего еду. Что-то из брошенного съедается, что-то просто обнюхивается – животное сыто. Ученые считают, что медведь таким образом не просто выпрашивает еду или  делает свою среду более разнообразной, он начинает управлять поведением посетителей: помахал – дали вкусненькое. Это снимает стресс от содержания в небольшом вольере и жизни по определённому распорядку. И все же не нужно зверей в зоопарке кормить – их рационы сбалансированы, и многое из того, что едим мы, им вредно.

Очень часто весной и в первой половине лета в зоопарке раздаются телефонные звонки, – люди хотят пристроить найденных в лесу медвежат. Мы призываем всех, кто увидел в лесу медвежонка – не берите его! Мать скорее всего где-то поблизости, она может встать на защиту своего детёныша, а это очень опасно для вас! Малыша мог отогнать и взрослый самец, ухаживающий за медведицей, да мало ли какие причины, кроме гибели медведицы, могли привести медвежонка к людям. Медведь, попавший к человеку, обречен быть убитым, или провести жизнь в неволе. Медвежонок, оставшийся в лесу один в возрасте 5-6 месяцев (июль-август) имеет очень неплохой шанс выжить и жить свободным. Не лишайте его этого шанса!

