Вид и человек
Эти звери были известны древним римлянам, по крайней мере, в первом веке нашей эры. Архивы японских императоров свидетельствуют о том, что белые медведи и их шкуры попадали в Японию и Маньчжурию уже в 7 веке, но население этих стран могло познакомиться с этими животными значительно раньше — медведи иногда достигают берегов Японии вместе с плавучими льдами. Древнейший письменный источник, содержащий сведения о белых медведях и относящийся к северу Европы, датируется примерно 880 годом — тогда два медвежонка были привезены из Норвегии в Исландию. В 1774 году белый медведь был впервые описан в научной литературе в качестве самостоятельного вида. Автор этого описания — английский зоолог Константин Фиппс.

Народы, населяющие Арктику, издавна охотились на этих животных. По мере освоения Севера человеком численность медведей сокращалась, но после запрета охоты и организации охраняемых территорий на местах родовых берлог начала увеличиваться. Однако в настоящее время она опять сокращается, так как медведи очень страдают из-за изменения климата — в Арктике поздно устанавливается ледяной покров, необходимый для успешной охоты на тюленей. В результате звери голодают, а медведицы, кроме того, не могут попасть к местам родовых берлог. Негативную роль играет загрязнение природной среды и фактор беспокойства.

Белые медведи очень любопытны, они обследуют любой новый предмет и часто посещают полярные станции. При этом они не агрессивны и, если люди не начинают их прикармливать, уходят.""",
