description_continuation: """Внешний вид, особенности морфологии и физиологии
Белый медведь — самый крупный зверь не только среди медведей, но и среди всех хищников. Среди самцов встречаются громадины, длина тела которых достигает 280 см, высота в холке — 150 см, а вес — 800 кг; самки мельче и легче. У белого медведя удлиненное туловище, узкое в передней части и массивное в задней, длинная и подвижная шея и относительно небольшая голова, со спрямлённым профилем, нешироким лбом и маленькими высоко посаженными глазами. У этого зверя очень сильные лапы с большими когтями. Ступни у медведя широкие, но мозоли почти незаметны под густой плотной шерстью. Такая шерсть покрывает всё тело зверя и имеет однотонную белую окраску, не меняющуюся по сезонам года.

А вот кожа у белого медведя тёмного, почти чёрного цвета, что способствует наименьшей теплоотдаче. Круглый год под кожей лежит толстый — 3–4 см слой жира; на задней части он может достигать толщины 10 см. Жир не только предохраняет зверя от холода и служит энергетической кладовой, но и делает его тело более лёгким, позволяя проще удерживаться на воде.
Головной мозг этого животного заметно отличается от мозга других хищных своими очертаниями и более сложным расположением борозд и извилин. В этом отношении он сходен с мозгом некоторых ластоногих, например, морского котика. Большее, чем у бурого медведя, развитие зрительной области мозга и меньшее обонятельной может говорить о том, что у белого медведя лучше развито зрение и хуже — обоняние, чем у его бурого собрата.

Специфично и отлично от других медведей строение пищеварительного тракта — кишечник короче, а желудок намного больше, чем у других представителей семейства, что позволяет голодному хищнику съесть сразу целого тюленя.
Образ жизни и социальная организация
В суровых условиях Арктики нет привычного нам чередования дня и ночи. Нет и выраженной суточной активности у населяющих её животных. В зимнюю же спячку, широко известную для бурых медведей, белые впадают далеко не все. Зимний сон характерен лишь для медведиц, собирающихся стать мамами, и пожилых самцов, пережидающих таким образом наиболее тяжелое время года. Крепкие, здоровые самцы и небеременные самки активны круглый год, отсиживаясь в свежевыкопанных в снегу берлогах лишь во время сильной пурги.

Белые медведи не придерживаются определённых индивидуальных участков, им принадлежит вся Арктика. Взрослые звери, как правило, бродят поодиночке. Добыв тюленя и насытившись, хищник отсыпается тут же, на месте удачной охоты, а, проснувшись, бредёт дальше. Встреча с собратом может происходить по-разному. Сытые звери чаще всего нейтральны по отношению друг к другу. Самки, имеющие маленьких медвежат, стараются не попадаться на глаза крупным самцам, которые, будучи голодными, охотятся на детёнышей. Если же встречи не избежать, медведица будет отчаянно защищать своих малышей.

Матёрый самец может отобрать добычу у молодого и даже попытаться его убить и съесть. В то же время около туши выброшенного морем кита собираются подчас десятки медведей, которые кормятся в нескольких метрах друг от друга, не проявляя к собратьям никакой агрессии.

Самки, имеющие маленьких медвежат чрезвычайно лояльны к осиротевшим детёнышам: известны случаи, когда самки принимали ивыкармливали их вместе с родными.

Питание и кормовое поведение
Белый медведь, в отличие от своих всеядных сородичей — хищник, активно добывающий крупных животных. Главная его жертва — арктические тюлени, в первую очередь, кольчатая нерпа. Охотясь на тюленя, медведь проявляет удивительную смекалку и находчивость: он может подкрадываться к своей жертве по льду, подкарауливать у воды, или подбираться к ней по воде. Медведь очень терпелив — подкрадываться к своей жертве он может по несколько часов, так же как и лежать возле лунки в ожидании вынырнувшего подышать животного. Мощным ударом передней лапы хищник убивает свою жертву и одним движением вытаскивает её на лёд. Чаще всего медведь ограничивается лишь подкожным слоем сала, поедая его вместе со шкурой, которую стягивает чулком с жертвы. Мясо доедают песцы ичайки, часто сопровождающие его в странствиях. Однако очень голодный медведь съедает и мясо тюленя, причём за один раз может съесть до 20 и более килограммов. Велика вероятность того, что следующая порция пищи попадёт ему в желудок лишь через несколько дней.

Иногда медведь охотится на молодняк крупных морских млекопитающих — моржей, белух и нарвалов. Настоящий пир начинается, когда море выбрасывает на берег труп кита. У туши собирается сразу несколько хищников — еды хватает всем.

Находясь на суше, медведи кормятся яйцами птиц, прихватывают леммингов. Кроме того, летом на материке и островах они едят ягоды морошки, в приливной зоне — водоросли типа ламинарии, фукуса. Медведицы после выхода из берлоги раскапывают снег и поедают побеги ивы и листья осоки.

Размножение и выращивание потомства
Спаривание у белых медведей происходит весной или летом. Звери могут держаться парами около двух недель, но чаще около самки собирается до 3 и даже 7 самцов, между которыми возникают драки.

В октябре — ноябре, когда ледовые поля подходят к островам, самки выходят на скалистые берега. Здесь на своих излюбленных местах вмощных снежных наносах они устраивают берлоги. Вход в берлогу всегда бывает ниже гнездовой камеры, благодаря чему в убежище значительно теплее, чем снаружи. Метели и ветры довершают строительство «дома», образуя над ним прочную крышу, иногда толщиной до 2 м. Здесь, после 230–250 дней беременности (включая латентную стадию, характерную для медведей, когда яйцеклетка неразвивается), в разгар арктической зимы появляются медвежата. Новорожденные столь же беспомощны, как и у других видов медведей, ивесят около 700 г. Способность видеть и слышать появляется у них лишь в месячном возрасте, ещё через месяц у детёнышей прорезываются зубы. К этому времени они начинают выходить из берлоги, но лишь в 3-х месячном возрасте способны следовать заматерью. С нею молодые животные не расстаются полтора года. Их отцы не принимают никакого участия в воспитании детей, напротив, представляют для них серьезную опасность, — каннибализм у белых медведей не редкость.

Впервые самка рождает одного детёныша в пяти-шестилетнем возрасте, в последующем у неё, скорее всего, будет рождаться по 2медвежонка один раз в три года.

Продолжительность жизни
В неволе белый медведь может прожить более 30 лет, в природе меньше.

Содержание животных в Московском зоопарке
За всё время существования зоопарка были лишь очень короткие периоды, когда у нас не содержались белые медведи. Имеются сведения, что первый белый медведь появился в 1871. В 1884 г. император Александр подарил зоопарку ещё двух белых медведей. У них рождались детёныши, но, к сожалению, из-за беспокойства со стороны людей матери отказывались их выкармливать, и первые рождённые в неволе медвежата погибли. В последующие годы в зоопарк попадали в основном медвежата, привезённые с полярных станций. В 1938 году взоопарке содержались одновременно 8 белых медведей. От них было получено и выращено потомство. В суровые военные годы энтузиасты зоопарка прилагали поистине героические усилия, чтобы сохранить животных, однако часть из них всё же погибла во время бомбёжек. В начале 1945 г. зоопарк принял ещё одного медвежонка в подарок от знаменитого полярника Папанина.

Сейчас в зоопарке живут три взрослых белых медведя, лишь один из которых родился в зоопарке, остальных, оставшихся без родительской опеки, подобрали и передали в зоопарк зимовщики с о. Врангеля и Чукотки. Им выделены две вольеры, в одной из которых, помимо обязательного бассейна, есть установка, из которой в жаркие летние дни идёт снег. Установка — подарок московского правительства, и она очень украсила жизнь наших мохнатых любимцев. Медведи любят отдыхать около сугроба и прятать в него остатки еды, а их дети с удовольствием играют в снегу.

Самки живут каждая в своём вольере, а самец перемещается, отселяют его лишь незадолго до того, как беременным самкам приходит пора ложиться в спячку. В это время будущих мам стараются как можно меньше беспокоить. На свет детёныши появляются в октябре—ноябре, но посетители зоопарка могут увидеть их в вольерах не раньше февраля. Первые 3–4 месяца жизни они, как и положено всем медвежатам, проводят с мамой в берлоге. В возрасте около одного года медвежата уезжают в другие зоопарки.

Кормление белых медведей в зоопарке очень разнообразно. Мясо они предпочитают всему остальному, а рыбу любят, преимущественно, крупную. Из разнообразных овощей и зелени, в первую очередь, медведи выбирают зелёный салат. Едят они и различные каши.

Конечно, жизнь в зоопарке легче, чем в природе, но и скучнее. «Посторонние» предметы, которые вы увидите в вольерах — игрушки медведей. Если не застанете медведей спящими, то, очень вероятно, вы увидите их играющими.
