description: """Систематика

Латинское название – Mareca (Anas) penelope

Английское название – Eurasian widgeon

Класс – Птицы (Aves)

Отряд – Гусеобразные (Anseriformes)

Семейство – Утиные (Anatidae)

Род – Свиязь (Mareca)

Впервые свиязь была описана Карлом Линнеем в 1758 году как Anas penelope. Сейчас систематики выделяют свиязь и ещё 2 близких вида в самостоятельный род - свиязь (Mareca).

Латинское название рenelope связано с именем мифической Пенелопы, которую эта утка спасла после того, как героиню выбросили в море.

Природоохранный статус

По международному статусу свиязь относится к видам, вызывающим наименьшие опасения – IUCN (LC). Является охотничьим видом, но, несмотря на активную охоту, считается наиболее благополучной из уток.

Вид и человек

Свиязь – объект промысловой и любительской охоты. Описание охоты на уток, в том числе и свиязей, можно найти у многих писателей - Тургенева, Аксакова, Пришвина.""",
location_text: """Распространение и места обитания

Свиязь гнездится в Северной Палеарктике от Исландии на западе до Чукотки и побережья Охотского моря на востоке. Основной ареал находится на территории России, Скандинавских стран, Финляндии и Северного Казахстана. В Западной Европе встречаются только отдельные небольшие популяции.

Практически по всему ареалу перелётная птица, оседлой является лишь небольшая популяция Британских островов. Часть популяции зимует на юге умеренной зоны от Испании до Японии, но большинство свиязей улетает в Восточную Африку, Южную и Юго-Восточную Азию.

Населяет тихие лесные водоемы от лесотундр до лесостепей, но считается преимущественно таёжной птицей, где плотность её гнездования наиболее высока. Часто селится в местах, где пологие берега покрыты пойменной луговой растительностью, либо вблизи полей с зерновыми культурами. Избегает мелких тёмных водоемов, открытых тундровых пространств и холмистой местности. Во время миграций держится на закрытых от ветра морских заливах, заболоченных морских низменностях, лагунах и эстуариях.""",
description_continuation: """Внешний вид

Свиязь – утка средних размеров с относительно короткой шеей, сравнительно коротким клювом и длинным заострённым хвостом. Общая длина 45-51 см, размах крыльев 75-86 см, масса самцов 600-1100 г, самок – 500-1000 г.

Половой диморфизм хорошо выражен. Весной и в первую половину лета самцы окрашены очень ярко: голова и шея каштанового цвета с чёрным крапом, верхняя часть туловища и бока серые с тёмным поперечным струйчатым рисунком, зоб розовато-серый, брюхо белое, хвост серый. От клюва до затылка через голову идет широкая светлая полоса, которая может иметь различные оттенки – от белого до золотисто-жёлтого. На крыльях как у летящих, так и сидящих на воде птиц хорошо заметны большие белые пятна и зелёные с фиолетовым отливом зеркальца. Клюв голубоватый с чёрным кончиком, ноги серые, радужка бурая.

Самки по окраске похожи на других уток северного полушария, их окраска является покровительственной. Сверху они рыжевато-бурые с многочисленными тёмными пестринами, зеркальце серо-зелёное.

Самцы после окончания летней линьки становятся похожими на самок, только белые пятна на крыльях сохраняются.

Молодые обоих полов практически не отличаются от самок, только на белом брюхе имеются тёмные пестрины, а зеркало более тусклое.

Вокализация

Свиязь – очень «разговорчивая» утка с весьма характерным и разнообразным набором издаваемых звуков. Наиболее обычный крик самца – плавный двусложный свист, который сравнивают с писком резиновой игрушки. В брачный период издает энергичный жужжащий свист. Самка отвечает низким грубым «кряканьем». Своей брачной  песней самцы свиязи хорошо выделяются среди всех представителей семейства утиных.

За характерный голос в разных частях ареала утка получила  своеобразные местные названия – свищ, свистун, свияга.

Образ жизни и социальное поведение

В  любое время года свиязи держатся плотными  шумными стаями, размер которых в зимнее время может достигать нескольких тысяч особей.

Отлёт с зимовок, расположенных в Европе, происходит рано – в конце марта – начале апреля. По данным из Индокитая свиязи улетают оттуда тоже рано – в марте. Однако к местам гнездования они прилетают лишь в середине апреля, а на севере – во второй половине мая.

Осенний отлет поздний – во второй половине сентября, когда в местах гнездования начинаются заморозки и выпадает первый снег.

Питание и кормовое поведение

Основу питания свиязи составляют растительные корма; об этом говорит её широкий и относительно короткий клюв. Кормится она зелёными частями растений и корневищами водных и околоводных растений, набор которых в её рационе достаточно велик и разнообразен. При необходимости эта утка легко переходит с одних видов растений на другие. Семена в рационе свиязи имеют второстепенное значение, хотя доля их может возрастать в разные сезоны.

Даже в летнее время, когда большинство уток переходит на животные корма, свиязи остаются вегетарианцами. Мелкие беспозвоночные животные, вероятно, попадают в желудки свиязей случайно, вместе с растительным кормом.

В зимнее время в питании свиязей начинают играть значительную роль морские  прибрежные водоросли. В случае их отсутствия по различным причинам, утки перемещаются на внутренние водоёмы, богатые семенами трав, или на зерновые посевы.

Ныряют свиязи хуже других уток. Отмечается, что во время кормежки они часто держатся поблизости от лебедей и нырковых уток и подбирают с поверхности воды корм, добытый со дна более искусными ныряльщиками.

Размножение

Образование пар  у свиязей происходит на ещё на зимовках и заканчивается на весеннем пролете. Токование выражается в том, что самцы кружатся на воде вокруг самок с взъерошенными перьями на голове и плечах. Самый же характерный элемент – громкий резкий свист, который издает самец, подняв вверх клюв.

Гнездо представляет собой ямку глубиной 5-7 см и располагается на сухом месте недалеко от воды. Обычно оно хорошо спрятано в сухой траве или в кустарнике. Гнездо выстлано сухой травой и большим количеством пуха.

Кладка происходит с конца мая до первых чисел июня. Полная кладка содержит 6-12, чаще 6-10 яиц кремового или белого цвета. Насиживает только самка в течение 22-25 дней. Самцы и не гнездящиеся самки собираются в линные стаи и улетают с мест гнездования, хотя очень больших стай во время линьки свиязи не образуют. Птенцы поднимаются на крыло в возрасте 40-45 дней, после чего выводки распадаются.

Часть самок приступают к размножению уже к концу первого года жизни, но большинство – на второй год.

Продолжительность жизни.

В природе срок жизни свиязей невелик – всего 3-4 года; в неволе, не подвергаясь опасности попасть под выстрел охотников, они могут прожить вдвое больше.

Жизнь в Московском зоопарке.

В нашем зоопарке несколько свиязей круглый год живут в вольере, расположенном слева от входа в павильон «Птицы и бабочки» на Новой территории вместе с другими птицами. Корм получают такой же, как остальные утки."""
