Вид впервые описан Карлом Линнеем в 1758 году.

Выделяется 2 подвида Anas strepera strepera – так называемый номинальный подвид, был описан Линнеем как обыкновенная серая утка. Второй подвид A.s. couesi когда-то обитал на коралловом атолле Тераина в Тихом океане, но исчез в 1874 году после появления там человека.

          Природоохранный статус

По международному статусу серая утка относится к видам, положение которых не вызывает опасений – IUCN (LG).

          Вид и человек

Серая утка относится к наиболее обычным объектам промысловой и спортивной охоты. Численность номинального подвида A.s.strepera достаточна высока и стабильна, а узко ареальный подвид A.s. couesi исчез в результате деятельности человека.

С другой стороны, серая утка – один из немногих видов, для которых хозяйственная деятельность человека оказала благоприятное воздействие. В ХIХ и ХХ веках её ареал значительно расширился в северном направлении. Кроме того, она стала обычной в некоторых частях Западной Европы, где раньше не встречалась.""",
location_text: """Распространение и места обитания

Серая утка гнездится в степной, лесостепной и, в меньшей степени, лесной зонах Евразии и Северной Америки. На территорию Европейской части России приходится ¾ гнездящихся в Европе серых уток.

В Западной Европе серые утки стали размножаться сравнительно недавно. Первые находки гнёзд этой птиц в Шотландии произошли в 1906 году, во Франции в 1925 году, в Германии в 1930, в Ирландии в 1937 г., в Эстонии – в 1920-х гг. Предполагается, что перемещение уток из районов степных озер в культурные ландшафты Европы связано с сильнейшими засухами в местах обычного гнездования этих птиц. В Великобритании практически вся популяция серых уток состоит из потомков птиц, завезенных в ХIХ веке и содержащихся в неволе.

В настоящее время гнездовой ареал серой утки в Европе и Северной Африке имеет мозаичный характер.

Частично перелётный вид. Большинство уток, гнездящихся в Прибалтике и западных областях России, зимует на морских побережьях стран Западной Европы, где они образуют совместные стаи с местными серыми утками, ведущими осёдлый образ жизни. Утки, гнездящиеся в Нижнем Поволжье и Южном Урале, зимуют на юге Каспийского моря (Иран), в Малой Азии и западном Черноморье. Сибирская популяция серых уток проводит зиму в Китае.

В гнездовой период серые утки держатся на мелководьях небольших заросших водоемов. После появления потомства выводки перебираются на более крупные озёра с открытой водой. Зимуют на морских побережьях.""",
description_continuation: """Внешний вид

Среднего размера утка, немного меньше кряквы. Общая длина 46-56 см, размах крыльев 84-95 см; самцы крупнее самок, их вес колеблется от 600 до 1300 г, самок – от 500 до 1000 г.

Половой диморфизм развит хуже, чем у других уток, и самцы не имеют ярких отличий от самок. Общий тон окраски самца серо-бурый, зеркальце на крыле трёхцветное. В нижней части оно бурого цвета, затем переходит в бархатисто-чёрное и сверху заканчивается белой полосой. Эта широкая белая полоса хорошо видна в полёте, что отличает серую утку от других близких видов. Клюв серый, ноги жёлтые с серыми перепонками. После линьки самцы становятся очень похожими на самок, что тоже характерно для серых уток. Самки в течение всего года светло-коричневые и очень похожи по окраске на самок кряквы.

