Серая утка – преимущественно растительноядный вид. Основу её питания составляют зелёные части водных и около водных растений, а также водоросли. Доля в рационе животной пищи увеличивается только в гнездовой период. Это водные беспозвоночные – насекомые, ракообразные, моллюски, а также мальки рыб и головастики. Утята кормятся преимущественно насекомыми. Корм эти утки добывают с поверхности воды, погружая в нее голову и шею. Реже они переворачиваются в воде так, что в воду погружается вся передняя часть тела, а на поверхности остается только хвостовая часть и ноги.

В конце лета утки могут кормиться на полях культурных злаков (там, где есть такая возможность) или на берегу, выкапывая из земли клубни и луковицы луговых трав.

