Враги в природе есть только у молодых, некрупных черных кайманов: это и хищные рыбы, и другие крокодилы, и анаконды, и хищные птицы, и ягуары. Когда же кайманы достигают примерно 1 м в длину, естественных врагов у них практически не остается.

Питание и пищевое поведение

В рационе маленьких кайманов преобладают беспозвоночные (особенно улитки), мелкая рыба и лягушки. Подросшие до 1 м кайманы охотятся на более крупную  рыбу, в том числе пираний, а также пришедших на водопой мелких млекопитающих, например, агути. Взрослые кайманы могут поймать более крупных животных: рыб, змей, черепах, птиц и млекопитающих. Среди млекопитающих жертвами черных кайманов чаще всего становятся различные обезьяны, ленивцы, броненосцы, носухи, олени, пекари и капибары. Кроме того, их добычей могут стать другие, более мелкие кайманы, анаконды, речные дельфины, ламантины.

Зубы у черных кайманов устроены так, что они не могут жевать добычу, они либо заглатывают ее целиком, либо вырывают крупные куски и проглатывают их.

Охотятся черные кайманы обычно в сумерках или ночью, подстерегая жертву в воде. Во время охоты они хватают добычу и  утаскивают в воду, где жертва захлебывается. Иногда черные кайманы охотятся и на суше, несмотря на свои относительно короткие и слабые конечности.

Вокализация

Все кайманы относятся к наиболее «голосистым» крокодилам. Голос черного каймана похож на раскаты грома. Обычно эти кайманы используют голос для общения с партнерами, особенно в брачный период.

Размножение и родительское поведение

Самки черного каймана откладывают яйца 1 раз в 2-3 года в засушливый период (сентябрь-декабрь). Они сооружают гнездо диаметром в 1,5 м неподалеку от мелководья и закапывают яйца в кучу растений. В кладке обычно бывает от 30 до 65 яиц, весом около 144 г каждое, покрытых плотной оболочкой. Самка остается около гнезда в течение всего периода инкубации, который может длиться от 42 до 90 дней в зависимости от окружающей температуры. К концу инкубации самка раскапывает яйца и помогает детенышам вылупиться. Большое количество гнезд черных кайманов погибает, их разоряют змеи, ящерицы тегу, некоторые птицы.

Первое время крокодильчики держатся на мелководье, часто несколько выводков объединяются в большую группу.

Смертность среди молодых кайманов очень велика, до взрослого состояния доживает совсем небольшое количество животных (меньше 20% от отложенных яиц).

Продолжительность жизни

Продолжительность жизни черных кайманов 40-50 лет, однако, известны случаи, когда отдельные особи доживали до 80 лет.


