Ареал крокодилового каймана  значительно шире, чем у всех других представителей семейства аллигаторов. Он занимает Центральную и Южную Америку от Мексики до Бразилии и Перу.  Есть интродуцированные (завезенные) популяции крокодиловых кайманов на Кубе и в США (Флорида).
