Вид и человек
Серая жаба поедает большое количество беспозвоночных и мелких грызунов - вредителей сельского хозяйства. Ядовитый секрет кожных выделений жаб применяется в фармацевтической промышленности.

Распространение
Вид широко распространен в Европе, Северной Азии, отдельные популяции – в Северной Африке и Малой Азии. В России населяет лесную зону от западных рубежей страны до Прибайкалья на востоке.

Встречается в хвойных, широколиственных и смешанных лесах, рощах, парках и садах. На юге ареала заселяет островные леса, кустарники, виноградники и луга. 

Внешний вид
Крупная жаба, длина тела 50-130 мм, в средиземноморских популяциях – до 200 мм. За глазами продолговатые железы – паротиды. Кожа спины с округлыми бугорками. Сверху светло-серая, серая, коричневая или оливково-бурая. Брюхо светло-серое или грязно-белое с темными пятнами. Самцы от самок отличаются стройным телосложением, небольшой головой и брачными мозолями на 1-3 пальцах передних конечностей.
Диета и кормовое поведение 
Питаются, в основном, наземными беспозвоночными, однако крупные жабы могут также поедать ящериц и грызунов. Отличаются слабой разборчивостью в выборе кормовых объектов, зачастую употребляя в пищу ядовитых, колючих или дурно пахнущих насекомых (колорадских жуков, жужелиц, клопов, волосатых гусениц и др.).

Активность
Весной после зимовки появляются на поверхности в марте - мае при температуре воздуха не ниже +10°С, уходят в зимовку в сентябре – начале ноября. Взрослые жабы в нерестовый период активны круглосуточно, а потом - лишь вечером и ночью, обычно до полуночи. В пасмурную и дождливую погоду могут встречаться и в дневное время. Сеголетки активны днем и вечером. Зимуют, закапываясь в грунт ниже глубины промерзания, находя укрытия в старых гниющих деревьях.

Размножение
Размножение происходит в марте – мае в озерах, прудах, канавах, больших ручьях при температуре воды 8-27°С, обычно 10-15°С и продолжается 3-14 суток. Оплодотворение наружное. Амплексус подмышечный. Икра в виде длинных (до 10 м, обычно – 1,5-6 м) двух-четырёхрядных шнуров. Её долго (6-24 ч.) откладывают на дно водоема или на погруженную растительность. Развитие икры, в зависимости от температуры длится 2-20 суток, личиночное развитие – 45-68 суток. Выход сеголетков длиной 10-27 мм происходит с июня до середины сентября. 

Половой зрелости достигают на 3-4-ом году жизни при длине тела 48-62 мм.

Миграции
Живут оседло на небольшом индивидуальном участке. В период размножения массово мигрируют к нерестовым водоемам на расстояние до 2,5 км.

