Природоохранный статус
Вид обычен.


Вид и человек
Является вредителем сельскохозяйственных растений. Во многих странах запрещена для домашнего содержания. В США нарушение этого запрета влечет за собой тюремное заключение и большой штраф, поскольку вследствие интродукции в эту страну ахатины быстро и бесконтрольно размножились и стали поедать всю растительность и даже штукатурку на домах.

В настоящее время расширение ареала ахатины остановлено благодаря строгим мерам по поддержанию карантина. На своей родине в Восточной Африке чрезмерное размножение ахатины сдерживает хищная улитка гонаксис, которая является естественным врагом ахатин.

В Европе, в том числе в России выживание ахатин в природе невозможно, поэтому запрета на их содержание нет, и эти улитки часто содержатся в качестве домашних животных.

С недавнего времени ахатин используют в качестве доноров нервных тканей для лечения болезней мозга.

На островах Южной части Тихого океана ахатины издавна используются в пищу. В настоящее время их также стали использовать в пищу японцы. Считается, что суп из ахатины - лекарство от туберкулеза, поэтому ахатин специально завезли в Индию, Сингапур, в Калифорнию и на многие тропические острова.

Ахатина является биоиндикатором загрязненности окружающей среды. При неблагоприятных условиях эти улитки прекращают рост, отстают в развитии, перестают питаться и впадают в спячку. В природе ахатины являются переносчиками паразитов, опасных и даже смертельных для человека.


Внешний вид
Ахатина имеет узкую коническую раковину, ширина которой примерно в 2 раза меньше длины. Раковина имеет до 9 витков. Размер раковины - до 20 см длиной и до 12 см диаметром. Однако, как правило, в среднем размер раковины составляет от 5 до 12 см с максимальным диаметром 6 см.

Окраска раковины может быть разной в зависимости от условий окружающей среды и диеты, но в основном - 2-х типов: красновато-коричневый с легкими желтоватыми вертикальными полосами или цвета светлого кофе. Рисунок у фулик имеется практически на всех витках.

Окраска тела улитки может быть или пятнисто-коричневая, или бледно-кремового цвета, что более редко встречается.


Распространение
Вид широко распространён в странах с тропическим климатом.

Родиной улитки является восточная Африка: Кения и Танзания. В дальнейшем она была завезена человеком в страны Южной и Юго-восточной Азии, на острова Тихого океана, Карибского моря.""",
location_text: """""",
description_continuation: """Диета и кормовое поведение
Ахатины всеядны. В природе предпочитают растительную пищу. Могут поедать загнивающие части растений, экскременты, падаль, грибы, водоросли, лишайники.


Активность
Сумеречная и ночная, хотя во влажную погоду могут быть активны и днём. Ахатины могут быть активны при +9+29 °C, однако выживают при падении температуры до +2 °C.


Размножение
Ахатина фулика — гермафродит, то есть каждая особь имеет как мужские, так и женские половые органы. При спаривании улиток одинакового размера возможно двустороннее оплодотворение. Если моллюски имеют разный размер, то более крупная улитка выступает в качестве женской особи, поскольку развитие яиц требует больших энергетических затрат. По той же причине молодые половозрелые улитки способны только к образованию сперматозоидов, яйцеклетки начинают образовываться ими позже. Число яиц в кладке около 200 (до 300). Размер яйца - 4,5 - 5,5 мм. Яйца имеют белый цвет и плотную скорлупу.


Миграции
Отсутствуют.


Родительское поведение
После откладки яиц родители не обращают на них внимания.


Продолжительность жизни
Ахатины живут до 10 лет. Всё время жизни они растут, однако после первых 2-х лет жизни скорость роста замедляется.


История жизни вида в зоопарке
На экспозиции (павильон "Птицы и бабочки") эти улитки обитают в стеклянном террариуме. В разводном помещении они содержатся в пластиковых садках с крышкой. Объём садка не менее 10 л на одну взрослую улитку. Субстрат имеет толщину около 10 см, в садках имеются куски коры и коряги, под которыми улитки могут прятаться. Температура содержания – +25ºС, относительная влажность воздуха – 50%. В стенках и в крышке садков есть вентиляционные отверстия, при этом повышенная влажность в садках сохраняется.
Длина светового дня – 12 часов.

Автор текста: О.Г. Капустьян"""
