description: """Систематика
Русское название - Перелетная или азиатская саранча

Латинское название - Locusta migratoria (Linnaeus 1758)

Английское название - Migratory locust

Класс - Насекомые

Отряд - Прямокрылые

Подотряд - Короткоусые Прямокрылые

Семейство - Настоящие Саранчовые


Природоохранный статус
Вид обычен.


Вид и человек
Перелетная саранча является серьезнейшим многоядным вредителем.

В годы массового размножения и вспышек численности саранчи серьезный урон наносится зерновым (пшеница, рожь, ячмень, овес, кукуруза, рис, сорго, просо), бобовым (горох, фасоль, соя, люцерна) культурам, а также сенокосам и пастбищам.

Личинки и имаго перелетной саранчи являются качественным сбалансированным кормом для многих насекомоядных животных. Они практически незаменимы при содержании многих видов малых обезьян и полуобезьян, грызунов, а также террариумных животных (рептилий, амфибий и пауков).


Внешний вид
Крупное насекомое, длина тела колеблется от 35 до 45 мм у самцов и от 45 до 55 мм у самок. Усики короткие. Мандибулы (челюсти) синего цвета. Надкрылья блестящие в бурых пятнышках, отчетливо длиннее брюшка. Крылья прозрачные со слабым желтовато-зеленым оттенком и черными жилками. Форма тела зависит от принадлежности особи к стадной или одиночной фазе. У особей одиночной фазы переднеспинка без перетяжек и с высоким дугообразным в профиль срединным килем. У особей стадной фазы переднеспинка седловидная с ясной перетяжкой и с прямым или слегка вогнутым срединным килем (в профиль).

Окраска обычно зеленая, бурая, желтовато-зеленая или серая, но также может варьировать в зависимости от фазы.


Распространение
У перелетной саранчи самая большая площадь распространения в мире среди саранчовых. Она включает практически все умеренные и тропические части восточного полушария, т.е. Европу, Африку, включая Мадагаскар, Арабский полуостров и полуостров Индостан, Кавказ, Центральную и Юго-Восточную Азию, Австралию, Папуа-Новую Гвинею и Новую Зеландию.

На этой огромной территории перелетная саранча распадается на 7 подвидов, из которых два - среднерусская и азиатская перелетная саранча - встречаются на территории России.

В России перелетная саранча распространена в Центрально-Черноземном, Волго- Вятском, Северо-Кавказском, Поволжском и Уральском регионах. Основной подвид - азиатская саранча - распространен в южных частях ареала, где среди тростниковых зарослей по берегам озер и в дельтах рек Кубань, Терек и Сулак существуют постоянные очаги размножения. Второй подвид - среднерусская саранча - обитает на Среднерусской возвышенности, на сухих песчаных хорошо прогреваемых участках в среднем течении Волги и Оки.""",
location_text: """""",
description_continuation: """Диета и кормовое поведение
Саранча – травоядное насекомое. Это довольно узкий олигофаг, она предпочитает дикие злаки (например, тростник и пырей). Несмотря на свои кормовые предпочтения, может поедать растения из многих семейств при нехватке излюбленного корма.

Особи стадной формы активнее и прожорливее особей одиночной формы.


Активность
Саранча имеет характерный суточный цикл, который связан с ее способностью активно поглощать солнечную энергию (например, при температуре воздуха +28°С тело саранчи может разогреться до +43°С) и интенсивной теплоотдачей. Поэтому ночью саранча впадает в холодовое, а в дневное время в солнечную, ясную погоду - в тепловое оцепенение и активна только в утренние и вечерние часы.


Размножение
Самка откладывает яйца в верхние слои почвы, раскапывая ее концом брюшка. Одновременно с откладкой яиц она выделяет из придаточных желез пенистую, быстро твердеющую на воздухе жидкость, которая цементирует частички почвы. Так образуется кубышка. Кубышка перелетной саранчи - большая, слабоизогнутая, иногда прямая, слегка сдавленная с боков, длиной 50-85 мм, диаметром 7-10 мм. Представляет собой столбик пенистого розовато-белого секрета, в котором помещены яйца. Стенки кубышки мягкие, матовые, коричнево - розовые.


Миграции
Стадная форма образует плотные скопления личинок, называемые кулигами, и взрослых особей (стаи), которые живут, питаются и движутся совместно. Кулиги саранчи в годы массового размножения могут занимать огромные площади (до нескольких тысяч гектаров) и преодолевать большие расстояния (до 45 км), поедая все на своем пути. Имаго саранчи объединяются в стаи и могут мигрировать на расстояния, превышающие 200 - 300 км, а подхваченные сильными ветрами - и более 1000 км, перелетая далеко за пределы гнездилищ.


Родительское поведение
После откладки яиц родители не обращают на них внимания.


Продолжительность жизни
За год развивается одно поколение. При благоприятных условиях взрослые насекомые могут прожить с начала июля до октября.


История жизни вида в зоопарке
В Московском зоопарке перелётная саранча разводится как кормовое насекомое. Культура перелётной саранчи существует в зоопарке с середины 80-х годов прошлого века. На экспозиции этот вид можно увидеть в павильоне «Птицы и бабочки» на выставке «Инсектопия».

Основным кормом для саранчи являются пшеничные проростки длиной 7 - 10 см, которые раскладываются на дне садков 2 раза в день. В питьевой воде саранча не нуждается. Для откладки яиц используются емкости с торфом. В каждом садке содержится 300 – 500 имаго или личинок среднего возраста. Низкая плотность содержания стимулирует переход к одиночной фазе, что нежелательно при массовом содержании.

Автор текста: Н.Н. Васюкова"""
),
