description_continuation: """Распространение
Обитает в Юго-Восточной Азии, Индии и Китае, интродуцирован в некоторые районы Европы и Северной Америки.


Диета и кормовое поведение
Бабочки не питаются. Гусеницы кормятся на различных древесных и кустарниковых растениях, в том числе на китайском ясене, айланте, сирени, бирючине, рябине и др.


Активность
У бабочек в основном ночная.


Размножение
Бабочки способны к размножению сразу после выхода из куколки. Спаривание происходит в ночные часы. Самцы активно летают в поисках самок. Самки сидят на коконе, из которого они вывелись в ожидании самцов. После спаривания самки отправляются в полёт, откладывая яйца группами на листья кормовых растений.


Миграции
Отсутствуют.


Родительское поведение
После откладки яиц родители не обращают на них внимания.


Продолжительность жизни
При температуре 26-28º С - продолжительность стадий:
- яйцо - 8 суток
- личинка – 25 - 30 суток
- куколка в отсутствие диапаузы - 14 суток
- взрослое насекомое (имаго) – около 7 дней.
В зависимости от подвида куколка может развиваться с диапаузой или без нее. Подвид Samia cynthia ricini является недиапаузирующим. Сигналом к началу диапаузы у остальных подвидов служит короткая продолжительность светового дня.


История жизни вида в зоопарке
Павлиноглазка цинтия содержится и постоянно размножается в Московском зоопарке. Увидеть бабочку, а также подержать в руках кокон и живую гусеницу цинтии можно, посетив экскурсию по экспозиции "Ночные бабочки" в павильоне "Оранжерея". Цинтии очень легко размножаются в искусственных условиях. В отличие от многих других видов бабочек, цинтия также не нуждается в большом пространстве для полета. Самцы спариваются с самками сразу же после выхода из кокона.Для откладки яиц самка не нуждается в кормовом растении, она откладывает яйца группами на стенки садка. Гусеницы цинтий выкармливаются летом на сирени и бирючине, а зимой - на искусственной многокомпонентной питательной среде, специально разработанной для этого вида. Питательная среда приготовляется в лаборатории Московского зоопарка.

