Вид и человек
В Китае существует древняя традиция, связанная с почитанием «поющих» насекомых. Сверчки разных видов играли в этой культуре немаловажную роль. Их содержали в специальных клеточках, которые иногда являлись настоящими произведениями искусства. В настоящее время в мире имеется немало любителей пения насекомых, которые содержат сверчков для этой цели.

В Китае, Вьетнаме, Камбодже и других азиатских странах разные виды сверчков употребляются в пищу.

